 ('61', '61', 'en_us', 'Home', '<h2>How we became the little church around the corner</h2>\n<p>Ad ullamcorper cursus vestibulum suspendisse parturient accumsan dignissim parturient accumsan adipiscing eget lectus condimentum aliquet lectus ullamcorper.</p>', 'the little church around the corner', 'A Brief History', '/about/our-history', 'We embrace all who seek', 'God’s inclusive love', NULL, NULL, NULL, NULL, NULL, '<p>How we became <em>the little church around the corner</em></p>', '<p>From our founding in 1848 to the Civil War, and our longstanding ties to the theater, discover the vibrant history of our little church.&nbsp;</p>', NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-25 16:28:45', '2017-09-14 21:36:54', '5b218861-31e8-4cba-82b7-c397bffb5bb2'),
