 ('69', '69', 'en_us', 'Welcome', '<p>Mi aptent suspendisse sociis augue pretium eleifend ante suspendisse ad condimentum a a scelerisque a sem tempor tristique vestibulum ultrices lectus consectetur potenti fusce ipsum parturient fermentum.Tincidunt aliquet tellus urna pretium a mus quis adipiscing a a porta eget aliquet ullamcorper mollis leo. Natoque class a a tellus condimentum purus curabitur a fusce arcu congue conubia mus natoque at.</p>', 'Welcome to our little church', NULL, NULL, NULL, NULL, '<p>Greetings and welcome to the Church of the Transfiguration, also known affectionately as the “Little Church Around the Corner”. Our parish combines the beauty and depth of the Anglo-Catholic tradition with the warmth of a dear community of people seeking the presence of Christ in the center of the NoMad neighborhood in Manhattan.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-26 11:22:17', '2017-09-14 19:49:02', 'eb269d89-72b0-4fc3-adcc-78b124fcade3'),
 ('72', '76', 'en_us', 'Rev’d Ian Betts', '<p>Dictum sit sed venenatis magnis nulla per parturient a dictumst urna a parturient velit scelerisque ullamcorper nec orci eu himenaeos mus amet adipiscing metus ut duis. Vitae parturient a sit ut quisque accumsan scelerisque in a a hac mattis a felis scelerisque blandit suspendisse mus montes a at adipiscing. </p>\n<p>Ullamcorper ipsum lobortis facilisi scelerisque a vestibulum nascetur id mattis tincidunt dictum netus dictumst pulvinar risus sagittis consectetur leo dolor cras. Laoreet facilisis leo ullamcorper a cursus interdum proin ad habitasse diam ridiculus a parturient mi parturient parturient scelerisque parturient suspendisse vestibulum.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Deacon', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-28 15:15:46', '2017-09-17 09:28:21', '94ed6965-27de-4909-b641-a1de6d1885ae'),
 ('73', '78', 'en_us', 'Rev’d John David van Dooren', '<p>Fr. John David van Dooren is a native of North Carolina, and was graduated from the University of North Carolina (1982) and the Virginia Theological Seminary (1987). His first field assignment was to an Anglo-Catholic parish, one of the only few in the the area. There Fr. van Dooren was introduced to a spirituality that would define his eventual priesthood and lead him to a lifelong commitment to urban ministry.</p>\n<p>After beginning his ordained life as chaplain and track and field coach at St. Stephen’s Episcopal School in Alexandria, VA (a happy period of life other than wrecking two school busses), Fr. van Dooren served as curate of All Souls Episcopal Church in Washington, DC. He then served as an assistant priest at St. Martin’s in the Field, Severna Park, MD, before being called back to All Souls as their sixth Rector.  After 14 years as Rector, Fr. van Dooren accepted the call to the Church of the Atonement in Chicago, where he served as Rector for eleven and half years. Fr. van Dooren was elected the eighth rector of Transfiguration in early 2017. He has shared the past 30 years of life with Gary Norcross.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Rector', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-28 15:42:05', '2017-09-17 09:28:56', '6dc7c368-debc-4200-aef6-4db119142c16'),
