 ('211', '227', 'en_us', 'Feature Little Church', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-31 18:50:03', '2017-09-17 09:41:54', 'a9ca272e-d71a-4b09-8e0e-f9f73d126ae4'),
 ('212', '228', 'en_us', 'Feature Little Church', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-31 19:05:48', '2017-09-17 09:41:32', '8f6d2095-2b51-41f5-93d5-15beff20a3c9'),
 ('213', '229', 'en_us', 'Rev’d Dr. Patrick S. Cheng', '<p>Fr. Patrick Cheng has served on the staff of The Church of the Transfiguration since 2015, first as an associate priest and currently as the associate rector.  Prior to his arrival at the Little Church, Fr. Cheng taught historical and systematic theology at the Episcopal Divinity School in Cambridge, Massachusetts, and served as the pastoral assistant at Emmanuel Church in the City of Boston.</p>\n<p>In addition to his ministry at Transfiguration, Fr. Cheng works for a national agency of the Episcopal Church, and he serves on the board of trustees of the Anglican Theological Review.  He holds degrees from Yale College, Harvard Law School, and Union Theological Seminary in the City of New York.  For more information about Fr. Cheng, please see his website at <a href=\"http://www.patrickcheng.net/\" target=\"_blank\" rel=\"noreferrer noopener\">www.patrickcheng.net</a>.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Associate Rector', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-31 19:57:03', '2017-09-17 09:28:41', '8d86a48b-2580-4935-bb75-6ab2c36b034c'),
 ('215', '231', 'en_us', 'Hero Our Mission', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-31 20:22:40', '2017-09-17 09:41:47', 'b3906941-fe1f-4c14-be07-4b10655611db'),
 ('217', '234', 'en_us', 'A Brief History', NULL, '', NULL, NULL, NULL, NULL, '<p>Church of the Transfiguration parish was founded in 1848. The building itself dates from 1850; it was made a national landmark in 1973. The founder, the Rev. Dr. George Hendric Houghton wanted to build a church that would serve the needs of the poor and marginalized, and would welcome all regardless of race, class or background.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-31 20:27:54', '2017-09-13 09:18:42', 'f971cb62-d5db-406e-956e-86f9f8f5cff4'),
 ('218', '235', 'en_us', 'Hero Our History', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-31 20:28:29', '2017-09-17 09:41:47', '12ea934f-07c1-4c66-9113-7a41cd3eab94'),
 ('220', '238', 'en_us', 'Hero Parish Life', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-31 20:33:51', '2017-09-17 09:41:47', '5873f20d-140a-431b-a303-683ecfc120fa'),
 ('221', '239', 'en_us', 'Parish Life', NULL, '', NULL, NULL, NULL, NULL, '<p>Building community is an important part of Church of the Transfiguration both spiritually and socially. Many of our parishioners gather each week on Thursday to participate in worship and Bible Study, while others enjoy going to a local restaurant after Sunday mass to enjoy brunch and social fellowship.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-08-31 20:36:16', '2017-09-16 23:19:26', 'c280ba7b-b46b-4106-991b-8f85d01e64ed'),
 ('224', '243', 'en_us', 'Hero Worship Schedule', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-01 10:10:20', '2017-09-17 09:41:48', '893eb1b8-dfd5-4bd7-94ae-bfeadaff31d9'),
 ('225', '244', 'en_us', 'Worship Schedule', NULL, '', NULL, NULL, NULL, NULL, '<p>The cornerstone of Transfiguration’s spirituality is how we express and demonstrate God’s inclusive love through liturgy, music and worship. As an Anglo-Catholic parish, Transfiguration honors traditional liturgy with a full complement of meaningful preaching and music.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-01 10:13:15', '2017-09-14 19:22:55', 'ed70f2e8-662a-4f6a-a3e9-c4fcbe403c0e'),
 ('226', '246', 'en_us', 'Hero Liturgy', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-01 11:19:33', '2017-09-17 09:41:33', '3c431052-6787-4ada-a8e0-44bfb8ec37fb'),
