 ('234', '254', 'en_us', 'Lynchgate', NULL, 'Lynchgate at The Church of the Transfiguration', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, '<p>A Lychgate is a type of medieval portal, covered by a roof. Lychgates are rare In the United States, but are still found in England, mostly in rural areas. In days past, it was a place where preliminary prayers were offered for the deceased before the coffin was carried into the church. Our lychgate was built in 1896. It was designed by Frederick Clark Withers and was the gift of Mrs. Franklin Delano. It was restored and re-dedicated on May 5, 2013.</p>', NULL, '0', NULL, '0', NULL, '2017-09-01 11:45:08', '2017-09-14 18:15:16', 'e67a4d34-10fb-4eda-8132-f426fe97b072'),
