 ('247', '267', 'en_us', 'Holy Family Chapel', NULL, 'Holy Family Chapel at The Church of the Transfiguration', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, '<p>The Holy Family Chapel is open Monday through Friday. Every day, it receives a steady stream of visitors who come in for a quiet moment, to light a candle, or to attend the daily Mass or prayer services. Its most memorable feature is the Brides’ Altar, which was installed in 1926. The painting above the altar is the Betrothal of the Blessed Virgin and St. Joseph. Tens of thousands of marriages have taken place before this altar.</p>', NULL, '0', NULL, '0', NULL, '2017-09-01 11:46:35', '2017-09-14 18:17:34', '4f9bd6fd-6df9-4f7c-be71-586e78cbeb9b'),
 ('248', '268', 'en_us', 'The Westmacott Madonna', NULL, 'The Westmacott Madonna at The Church of the Transfiguration', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, '<p>The Westmacott Madonna is located in the southwest corner of the chapel. This beautiful marble statue of the Madonna and Child is by Sir Richard Westmacott. R.A., who also did the portico sculptures at Buckingham Palace celebrating the battles of Trafalgar and Waterloo.</p>', NULL, '0', NULL, '0', NULL, '2017-09-01 11:47:05', '2017-09-14 18:18:52', 'aef6a7ba-905e-47bf-a08d-a75d5f7f437a'),
 ('249', '271', 'en_us', 'Outreach', NULL, '', NULL, NULL, NULL, NULL, '<p>Our parish was founded to serve the needs of the poor and marginalized, and this tradition continues today through several programs. Perhaps our most important outreach, however, is the Holy Family Chapel which is open and welcoming to all who are in search of spiritual refreshment.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-05 14:56:51', '2017-09-16 16:19:52', '5c70889d-551a-43df-8db2-9b65f697daa8'),
