 ('298', '324', 'en_us', 'Music at Transfiguration', NULL, '', NULL, NULL, NULL, NULL, '<p>Music has always been a vital element of the church’s Anglo-Catholic worship style. Soon after the church was founded, The Rev. George Houghton established the Choir of Men and Boys , the oldest such choir in America. The choir sings a vast repertoire of liturgical music appropriate to the day. In recent years, the church established a Girls Choir and a Cherub Choir.</p>', NULL, NULL, NULL, 'Benjamin Chasteen/Epoch Times', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-13 09:19:39', '2017-09-13 10:52:00', 'a38964e3-9eda-497b-bd1a-634639ac0840'),
 ('300', '326', 'en_us', 'Hero Music At Transfiguration', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-13 09:26:39', '2017-09-17 09:41:46', 'd8665318-a82b-4bf5-985a-a58c0a1aefe7'),
