 ('303', '329', 'en_us', 'Organist & Choirmaster', NULL, '', NULL, NULL, NULL, NULL, '<p>Dr. Claudia Dumschat brings over forty years of experience to her position as Organist and Choirmaster at Transfiguration, where she has served since 1999. She administers and conducts the Choir of Men and Boys, Girls Choir, Cherub Choir and Camerata. She is also the Artistic Director and Conductor of the church’s Concert Series, which has produced over fifty concerts, music dramas, and operas, as well as the Midday Music and Summer Concerts series.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-13 09:42:08', '2017-09-13 10:47:26', '76b8cc33-356b-42da-8b0d-cb074fbac45d'),
