 ('323', '353', 'en_us', 'The Joseph Jefferson Window', NULL, 'The Joseph Jefferson Window at The Church of the Transfiguration', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, '<p>The Joseph Jefferson window on the South wall of the main church building, memorializes the renowned actor who gave the Church of the Transfiguration its nickname, “The Little Church Around the Corner”. Jefferson is seen costumed as Rip Van Winkle, a role he was famous for. He is accompanying his deceased friend, George Holland to the church, where they are met by Jesus standing at the lychgate. The window is a gift of the Episcopal Actors Guild, and was installed in 1925.</p>\r\n<p></p>', NULL, '0', NULL, '0', NULL, '2017-09-14 18:20:39', '2017-09-14 18:21:01', '40fdc139-426f-47f4-8c7c-0ac30984678b'),
 ('325', '355', 'en_us', 'Liturgy', NULL, '', NULL, NULL, NULL, NULL, '<p>Aenean ac velit phasellus vivamus condimentum habitant vestibulum nibh parturient tincidunt mi malesuada cursus nunc risus parturient a condimentum augue gravida metus. Ut at a a turpis facilisi parturient ac non quisque a parturient habitasse cubilia adipiscing imperdiet.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-14 19:20:28', '2017-09-14 19:24:45', 'b74233dc-36fd-46fb-9dbe-f711c3e24e09'),
 ('327', '358', 'en_us', 'Hero Bible Study', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-14 19:32:53', '2017-09-17 09:41:45', '6a9eb95f-a99a-4288-ae24-78b5ae376244'),
 ('328', '359', 'en_us', 'Bible Study', NULL, '', NULL, NULL, NULL, NULL, '<p>The Thursday night study, which resumed on September 21st, continues throughout October. The evening begins with a mass in the chapel at 6:30 pm. Following the mass, the study will begin at 7:00 pm in the common room. <strong>Newcomers Welcome</strong>.</p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-14 19:36:40', '2017-09-16 16:17:13', '5a2e74a8-13e1-4b63-a1bc-27a43f81492c'),
 ('330', '362', 'en_us', 'Hero Weddings', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-14 21:12:46', '2017-09-17 09:41:48', '4eb2dc8f-e0d7-487d-bd29-46453425375b'),
 ('331', '363', 'en_us', 'Weddings', NULL, '', NULL, NULL, NULL, NULL, '<p>Congratulations on your engagement, and thanks for your interest in becoming married at The Church of the Transfiguration. Our church is a beautiful place with a century-old reputation for marrying couples from all over the world. At one time, Transfiguration solemnized more marriages than any other church! We welcome you to join our \"little family\", and we hope to become a part of yours.</p>', NULL, NULL, NULL, 'Jesse Anders /On Point Images ', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-14 21:14:41', '2017-09-14 21:40:46', '56df98e0-0755-41b0-bf3e-ebc7ba535488'),
 ('333', '366', 'en_us', 'Featured Fpo', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-15 13:14:06', '2017-09-17 09:41:31', 'dace0d27-127a-41b8-af86-7324000a0734'),
