 ('341', '374', 'en_us', 'Hero Adult Education', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-16 16:20:36', '2017-09-17 09:41:44', '75677dc6-a2d6-4ec1-ac7e-cc51c0a3b180'),
 ('342', '375', 'en_us', 'Adult Education', NULL, '', NULL, NULL, NULL, NULL, '<p>Our Adult Education forums cover a wide variety of spiritual topics both within the Church and elsewhere. The series hosts a number of guest speakers and facilitators and promises an hour of entertaining and informational learning and discussion.<br /></p>', NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, '0', NULL, '0', NULL, '2017-09-16 16:25:03', '2017-09-16 16:25:03', 'e5fa0777-fe97-4ed0-bbb9-ad4e4ca92186'),
 ('343', '377', 'en_us', 'Adult Education', NULL, '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '<p>Sexuality and Patriarchy in the Old Testament\" with <strong>Karina Martin Hogan</strong></p>', '0', '', '2017-09-16 17:11:37', '2017-09-17 14:01:34', '2604b984-f72c-4b62-b86b-965a568c6c67'),
