 ('350', '384', 'en_us', 'Founder’s Day', NULL, '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', '<p>On the first Sunday in October 1848, George Hendric Houghton gathered a band of twenty-four followers for a celebration of Holy Communion in the parlor of the home of the Rev. Dr. Lawson Carter, an elderly priest, on East 24th Street.  None of those first worshipers could have imagined that they had just attended the first service of the Church of the Transfiguration, later to be celebrated as ‘The Little Church Around the Corner’. The twenty-eight year-old priest who called this small congregation into being, however, had a clear vision in mind:  to establish a parish that would minister to the poor and needy of New York City. The first service in the new church was held on Sunday, March 28th, 1850.” <em>(excerpted from A Parish Guide to The Church of the Transfiguration by Zulette M. Catir)</em>    </p>\n<p>His motto was <em>Fides Opera</em>  (Faith and Works) \n</p>', '1', '<p>Vivamus parturient per facilisis vitae himenaeos adipiscing lacus nulla mattis a ridiculus condimentum.</p>', '2017-09-16 21:50:54', '2017-09-17 12:31:27', '2fe11b9b-78b6-48c0-990b-4a04a1af117a'),
