 ('51', '94', '9', '1', 'en_us', '2', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Good Things Come in Threes\",\"slug\":\"good-things-come-in-threes\",\"postDate\":1504084080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"25\":[\"93\"],\"26\":\"Mary Jane Gocher\",\"27\":\"Corey Schneider\"}}', '2017-08-30 13:14:24', '2017-08-30 13:14:24', 'c9efcabf-ab75-42db-b7ea-f6c751fd180d'),
 ('52', '94', '9', '1', 'en_us', '3', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Good Things Come in Threes\",\"slug\":\"good-things-come-in-threes\",\"postDate\":1504084080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"28\":{\"new1\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p><span class=\\\"s1\\\">I was paging my way through <i>Holy Men, Holy Women<\\/i> on a fact-checking mission when I came across the entry for December 16<\\/span><span class=\\\"s2\\\"><sup>th<\\/sup><\\/span><span class=\\\"s1\\\">.<\\/span><\\/p>\\r\\n<p><span class=\\\"s1\\\"><\\/span>\\r\\n<\\/p>\\r\\n<p><span class=\\\"s1\\\">I was stunned to see that this day had been set apart to honor two architects and an artist whose work was represented here at Transfiguration:<span class=\\\"Apple-converted-space\\\">&nbsp; <\\/span>Ralph Adams Cram, designer of St. Thomas Church NYC and the nave of the Cathedral of St. John the Divine, Richard Upjohn, the designer of Trinity Church on Wall Street in lower Manhattan, and John Lafarge, painter of murals and designer of many notable stained glass windows.<\\/span><\\/p>\\r\\n<p><span class=\\\"s1\\\"><\\/span>\\r\\n<\\/p>\\r\\n<p><span class=\\\"s1\\\"><i>Holy Men, Holy Women<\\/i> encourages us to offer thanks for \\u201cthe vision of Ralph Adams Cram, John LaFarge and Richard Upjohn, whose harmonious revival of the Gothic enriched our churches with a sacramental understanding of reality in the face of secular materialism&hellip;.\\u201d *<\\/span><\\/p>\\r\\n<p><span class=\\\"s1\\\"><\\/span>\\r\\n<\\/p>\\r\\n<p><span class=\\\"s1\\\">Ralph Adams Cram was the designer of our beautiful polychromed wood Madonna Shrine, located in the Transept.<span class=\\\"Apple-converted-space\\\">&nbsp; <\\/span>It was donated by Mr. F. E. Saxham Drury in memory of Elbridge T. Gerry and Mabel Gerry Drury.<\\/span><\\/p>\\r\\n<p><span class=\\\"s1\\\"><\\/span>\\r\\n<\\/p>\\r\\n<p><span class=\\\"s1\\\">Turn to your right, and there is John LaFarge\\u2019s magnificent window depicting Edwin Booth, the leading Shakespearean actor of his time, holding a mask and dressed in Greco-Roman costume.<span class=\\\"Apple-converted-space\\\">&nbsp; <\\/span>(Edwin Booth was the brother of the notorious John Wilkes Booth, President Lincoln\\u2019s assassin.) The window was given in his memory in 1898 by members of the Players Club, which he founded.<\\/span><\\/p>\\r\\n<p><span class=\\\"s1\\\"><\\/span>\\r\\n<\\/p>\\r\\n<p><span class=\\\"s1\\\">And a few steps away, near the chancel on the northeast side of the nave, stands Richard Upjohn\\u2019s beautiful and intricate brass filigree pulpit.<\\/span><\\/p>\\r\\n<p><span class=\\\"s1\\\"><\\/span>\\r\\n<\\/p>\\r\\n<p><span class=\\\"s1\\\">How fortunate we are to have works by all three of these masters under the roof of the \\u201cLittle Church\\u201d.<span class=\\\"Apple-converted-space\\\">&nbsp; <\\/span>I will give thanks when December 16<\\/span><span class=\\\"s2\\\"><sup>th<\\/sup><\\/span><span class=\\\"s1\\\"> rolls around.<\\/span><\\/p>\"}}},\"25\":[\"93\"],\"26\":\"Mary Jane Gocher\",\"27\":\"Corey Schneider\"}}', '2017-08-30 13:55:36', '2017-08-30 13:55:36', '1d105e5f-5d97-461d-800c-65547d002481'),
 ('53', '94', '9', '1', 'en_us', '4', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Good Things Come in Threes\",\"slug\":\"good-things-come-in-threes\",\"postDate\":1504084080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"28\":{\"107\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>I was paging my way through <em>Holy Men, Holy Women<\\/em> on a fact-checking mission when I came across the entry for December 16<sup>th<\\/sup>.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>I was stunned to see that this day had been set apart to honor two architects and an artist whose work was represented here at Transfiguration:&nbsp; Ralph Adams Cram, designer of St. Thomas Church NYC and the nave of the Cathedral of St. John the Divine, Richard Upjohn, the designer of Trinity Church on Wall Street in lower Manhattan, and John Lafarge, painter of murals and designer of many notable stained glass windows.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p><em>Holy Men, Holy Women<\\/em> encourages us to offer thanks for \\u201cthe vision of Ralph Adams Cram, John LaFarge and Richard Upjohn, whose harmonious revival of the Gothic enriched our churches with a sacramental understanding of reality in the face of secular materialism&hellip;.\\u201d *<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>Ralph Adams Cram was the designer of our beautiful polychromed wood Madonna Shrine, located in the Transept.&nbsp; It was donated by Mr. F. E. Saxham Drury in memory of Elbridge T. Gerry and Mabel Gerry Drury.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>Turn to your right, and there is John LaFarge\\u2019s magnificent window depicting Edwin Booth, the leading Shakespearean actor of his time, holding a mask and dressed in Greco-Roman costume.&nbsp; (Edwin Booth was the brother of the notorious John Wilkes Booth, President Lincoln\\u2019s assassin.) The window was given in his memory in 1898 by members of the Players Club, which he founded.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>And a few steps away, near the chancel on the northeast side of the nave, stands Richard Upjohn\\u2019s beautiful and intricate brass filigree pulpit.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>How fortunate we are to have works by all three of these masters under the roof of the \\u201cLittle Church\\u201d.&nbsp; I will give thanks when December 16<sup>th<\\/sup> rolls around.<\\/p>\"}}},\"25\":[\"93\"],\"26\":\"Mary Jane Gocher\",\"27\":\"Corey Schneider\"}}', '2017-08-30 13:55:55', '2017-08-30 13:55:55', '8c9f18f8-bc98-4a7e-ad83-85a27412968d'),
 ('54', '94', '9', '1', 'en_us', '5', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Good Things Come in Threes\",\"slug\":\"good-things-come-in-threes\",\"postDate\":1504084080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"28\":{\"107\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>I was paging my way through <em>Holy Men, Holy Women<\\/em> on a fact-checking mission when I came across the entry for December 16<sup>th<\\/sup>.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>I was stunned to see that this day had been set apart to honor two architects and an artist whose work was represented here at Transfiguration:&nbsp; Ralph Adams Cram, designer of St. Thomas Church NYC and the nave of the Cathedral of St. John the Divine, Richard Upjohn, the designer of Trinity Church on Wall Street in lower Manhattan, and John Lafarge, painter of murals and designer of many notable stained glass windows.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p><em>Holy Men, Holy Women<\\/em> encourages us to offer thanks for \\u201cthe vision of Ralph Adams Cram, John LaFarge and Richard Upjohn, whose harmonious revival of the Gothic enriched our churches with a sacramental understanding of reality in the face of secular materialism&hellip;.\\u201d *<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>Ralph Adams Cram was the designer of our beautiful polychromed wood Madonna Shrine, located in the Transept.&nbsp; It was donated by Mr. F. E. Saxham Drury in memory of Elbridge T. Gerry and Mabel Gerry Drury.<\\/p>\"}},\"new1\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>Turn to your right, and there is John LaFarge\\u2019s magnificent window depicting Edwin Booth, the leading Shakespearean actor of his time, holding a mask and dressed in Greco-Roman costume.&nbsp; (Edwin Booth was the brother of the notorious John Wilkes Booth, President Lincoln\\u2019s assassin.) The window was given in his memory in 1898 by members of the Players Club, which he founded.<\\/p>\\r\\n<p>And a few steps away, near the chancel on the northeast side of the nave, stands Richard Upjohn\\u2019s beautiful and intricate brass filigree pulpit.<\\/p>\\r\\n<p>How fortunate we are to have works by all three of these masters under the roof of the \\u201cLittle Church\\u201d.&nbsp; I will give thanks when December 16<sup>th<\\/sup>&nbsp;rolls around.<\\/p><p><\\/p>\"}}},\"25\":[\"93\"],\"26\":\"Mary Jane Gocher\",\"27\":\"Corey Schneider\"}}', '2017-08-30 14:03:42', '2017-08-30 14:03:42', 'b5d1792d-8c2e-4297-832d-7b83c418cc39'),
