 ('62', '94', '9', '1', 'en_us', '12', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Good Things Come in Threes\",\"slug\":\"good-things-come-in-threes\",\"postDate\":1504084080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"28\":{\"107\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>I was paging my way through <em>Holy Men, Holy Women<\\/em> on a fact-checking mission when I came across the entry for December 16<sup>th<\\/sup>.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>I was stunned to see that this day had been set apart to honor two architects and an artist whose work was represented here at Transfiguration:&nbsp; Ralph Adams Cram, designer of St. Thomas Church NYC and the nave of the Cathedral of St. John the Divine, Richard Upjohn, the designer of Trinity Church on Wall Street in lower Manhattan, and John Lafarge, painter of murals and designer of many notable stained glass windows.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p><em>Holy Men, Holy Women<\\/em> encourages us to offer thanks for \\u201cthe vision of Ralph Adams Cram, John LaFarge and Richard Upjohn, whose harmonious revival of the Gothic enriched our churches with a sacramental understanding of reality in the face of secular materialism&hellip;\\u201d *<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>Ralph Adams Cram was the designer of our beautiful polychromed wood Madonna Shrine, located in the Transept.&nbsp; It was donated by Mr. F. E. Saxham Drury in memory of Elbridge T. Gerry and Mabel Gerry Drury.<\\/p>\"}},\"111\":{\"type\":\"figure\",\"enabled\":\"1\",\"fields\":{\"image\":[\"110\"],\"altAttribute\":\"John LaFarge\\u2019s magnificent window depicting Edwin Booth\",\"caption\":\"<p>John LaFarge\\u2019s magnificent window depicting Edwin Booth<\\/p>\",\"enlarge\":\"1\"}},\"108\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>Turn to your right, and there is John LaFarge\\u2019s magnificent window depicting Edwin Booth, the leading Shakespearean actor of his time, holding a mask and dressed in Greco-Roman costume.&nbsp; (Edwin Booth was the brother of the notorious John Wilkes Booth, President Lincoln\\u2019s assassin.) The window was given in his memory in 1898 by members of the Players Club, which he founded.<\\/p>\\r\\n<p>And a few steps away, near the chancel on the northeast side of the nave, stands Richard Upjohn\\u2019s beautiful and intricate brass filigree pulpit.<\\/p>\\r\\n<p>How fortunate we are to have works by all three of these masters under the roof of the \\u201cLittle Church\\u201d.&nbsp; I will give thanks when December 16<sup>th<\\/sup>&nbsp;rolls around.<\\/p>\"}}},\"25\":[\"93\"],\"26\":\"Mary Jane Gocher\",\"27\":\"Corey Schneider\"}}', '2017-08-30 15:21:52', '2017-08-30 15:21:52', '849cb71d-ed83-4707-8c3f-bda210182ebc'),
