 ('65', '69', '7', '1', 'en_us', '37', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Welcome\",\"slug\":\"welcome\",\"postDate\":1503746520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"Welcome to our little church\",\"13\":{\"71\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>First time here?<\\/h2>\\r\\n<p>I invite you to join us in worship and fellowship at any one of our services, coffee hour, concert series, or a simple contemplative visit to our garden and chapel. I like to think of our parish as a quiet oasis in the heart of this vibrant city. And yet we have so much going on at our Little Church.<\\/p>\"}},\"73\":{\"type\":\"figureFull\",\"enabled\":\"\",\"fields\":{\"image\":[\"72\"],\"altAttribute\":\"\",\"caption\":\"<p>This is a caption<\\/p>\",\"credit\":\"\"}},\"74\":{\"type\":\"generalSection\",\"enabled\":\"\",\"fields\":{\"text\":\"<h2>Sem inceptos sociosqu interdum<\\/h2>\\r\\n<p>Consequat orci a cum suspendisse pretium orci dui dapibus ultricies nisi vulputate erat a dui. Ultricies enim a ut per egestas augue dis ad tellus mus a hac ac a scelerisque ullamcorper eupraesent quisque adipiscing. Erat purus ante habitasse mus interdum scelerisque a hac fermentum cum conguesuspendisse scelerisque auctor condimentum eu ipsum varius cursus a tempus aenean consectetur et a. Cubilia scelerisque ligula fusce a consequat vel fames a arcu mi nisl et at ultrices nunc. Sem inceptos sociosqu interdum adipiscing quis aliquam adipiscing vel taciti enim penatibus et ullamcorper venenatis.<\\/p>\\r\\n<blockquote>The Church of the Transfiguration is a community committed to faith in action. We embrace all who seek God\\u2019s inclusive love<\\/blockquote>\\r\\n<p>Consequat orci a cum suspendisse pretium orci dui dapibus ultricies nisi vulputate erat a dui. Ultricies enim a ut per egestas augue dis ad tellus mus a hac ac a scelerisque ullamcorper eupraesent quisque adipiscing. Erat purus ante habitasse mus interdum scelerisque a hac fermentum cum conguesuspendisse scelerisque auctor condimentum eu ipsum varius cursus a tempus aenean consectetur et a. Cubilia scelerisque ligula fusce a consequat vel fames a arcu mi nisl et at ultrices nunc. Sem inceptos sociosqu interdum adipiscing quis aliquam adipiscing vel taciti enim penatibus et ullamcorper venenatis.<\\/p>\"}},\"75\":{\"type\":\"generalSection\",\"enabled\":\"\",\"fields\":{\"text\":\"<h3>Sem inceptos sociosqu interdum<\\/h3>\\r\\n<p>Consequat orci a cum suspendisse pretium orci dui dapibus ultricies nisi vulputate erat a dui. Ultricies enim a ut per egestas augue dis ad tellus mus a hac ac a scelerisque ullamcorper eupraesent quisque adipiscing. Erat purus ante habitasse mus interdum scelerisque a hac fermentum cum conguesuspendisse scelerisque auctor condimentum eu ipsum varius cursus a tempus aenean consectetur.<\\/p>\"}},\"77\":{\"type\":\"bioGroup\",\"enabled\":\"\",\"fields\":{\"bioType\":\"Leadership\",\"individual\":[\"78\",\"76\"]}}},\"11\":[\"68\"],\"12\":\"<p>Welcome to the Church of the Transfiguration located in Manhattan\'s NoMad district. We are an Episcopal Church and part of the larger, worldwide Anglican Communion, with a&nbsp;<a href=\\\"#\\\">rich musical and liturgical tradition<\\/a>. We host a diverse community embracing all people, across a vast spectrum of cultural, ethnic, racial, gender, sexual orientation, and economic backgrounds, as full members in the body of Christ.<\\/p>\",\"27\":\"Meghan Joseph\"}}', '2017-08-30 18:44:04', '2017-08-30 18:44:04', '3d1a887e-cd4e-4f9c-9831-a5be1c8229e2'),
