 Transept.&nbsp; It was donated by Mr. F. E. Saxham Drury in memory of Elbridge T. Gerry and Mabel Gerry Drury.<br><\\/p><p>Turn to your right, and there is John LaFarge\\u2019s magnificent window depicting Edwin Booth, the leading Shakespearean actor of his time, holding a mask and dressed in Greco-Roman costume.&nbsp; (Edwin Booth was the brother of the notorious John Wilkes Booth, President Lincoln\\u2019s assassin.) The window was given in his memory in 1898 by members of the Players Club, which he founded.<\\/p>\"}},\"123\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>Ralph Adams Cram was the designer of our beautiful polychromed wood Madonna Shrine, located in the Transept.&nbsp; It was donated by Mr. F. E. Saxham Drury in memory of Elbridge T. Gerry and Mabel Gerry Drury.<\\/p>\\r\\n<p>And a few steps away, near the chancel on the northeast side of the nave, stands Richard Upjohn\\u2019s beautiful and intricate brass filigree pulpit.<\\/p>\"}},\"122\":{\"type\":\"figure\",\"enabled\":\"1\",\"fields\":{\"image\":[\"125\"],\"altAttribute\":\"Richard Upjohn\\u2019s beautiful and intricate brass filigree pulpit\",\"caption\":\"<p>Richard Upjohn\\u2019s beautiful and intricate brass filigree pulpit<\\/p>\",\"enlarge\":\"1\",\"orientation\":\"horizontal\"}},\"126\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>How fortunate we are to have works by all three of these masters under the roof of the \\u201cLittle Church\\u201d.&nbsp; I will give thanks when December 16<sup>th<\\/sup>&nbsp;rolls around.<\\/p>\"}}},\"25\":[\"93\"],\"26\":\"Mary Jane Gocher\",\"27\":\"Corey Schneider\"}}', '2017-08-30 23:25:49', '2017-08-30 23:25:49', '89e888c6-048e-4723-a473-33e8036a94eb'),
