 ('82', '94', '9', '1', 'en_us', '27', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Good Things Come in Threes\",\"slug\":\"good-things-come-in-threes\",\"postDate\":1504084080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"28\":{\"107\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>I was paging my way through <em>Holy Men, Holy Women<\\/em> on a fact-checking mission when I came across the entry for December 16<sup>th<\\/sup>.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>I was stunned to see that this day had been set apart to honor two architects and an artist whose work was represented here at Transfiguration:&nbsp; Ralph Adams Cram, designer of St. Thomas Church NYC and the nave of the Cathedral of St. John the Divine, Richard Upjohn, the designer of Trinity Church on Wall Street in lower Manhattan, and John Lafarge, painter of murals and designer of many notable stained glass windows.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p><em>Holy Men, Holy Women<\\/em> encourages us to offer thanks for \\u201cthe vision of Ralph Adams Cram, John LaFarge and Richard Upjohn, whose harmonious revival of the Gothic enriched our churches with a sacramental understanding of reality in the face of secular materialism&hellip;\\u201d *<\\/p>\"}},\"111\":{\"type\":\"figure\",\"enabled\":\"1\",\"fields\":{\"image\":[\"211\"],\"altAttribute\":\"John LaFarge\\u2019s magnificent window depicting Edwin Booth\",\"caption\":\"<p>John LaFarge\\u2019s magnificent window depicting Edwin Booth<\\/p>\",\"enlarge\":\"1\",\"orientation\":\"vertical\"}},\"108\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p><em>Holy Men, Holy Women<\\/em>&nbsp;encourages us to offer thanks for \\u201cthe vision of Ralph Adams Cram, John LaFarge and Richard Upjohn, whose harmonious revival of the Gothic enriched our churches with a sacramental understanding of reality in the face of secular materialism&hellip;\\u201d *<br><\\/p>\\r\\n<p>Ralph Adams Cram was the 