designer of our beautiful polychromed wood Madonna Shrine, located in the Transept. It was donated by Mr. F. E. Saxham Drury in memory of Elbridge T. Gerry and Mabel Gerry Drury.<br><\\/p>\\r\\n<p>Turn to your right, and there is John LaFarge\\u2019s magnificent window depicting Edwin Booth, the leading Shakespearean actor of his time, holding a mask and dressed in Greco-Roman costume.&nbsp; (Edwin Booth was the brother of the notorious John Wilkes Booth, President Lincoln\\u2019s assassin.) The window was given in his memory in 1898 by members of the Players Club, which he founded.<\\/p>\"}},\"123\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>Ralph Adams Cram was the designer of our beautiful polychromed wood Madonna Shrine, located in the Transept.&nbsp; It was donated by Mr. F. E. Saxham Drury in memory of Elbridge T. Gerry and Mabel Gerry Drury.<\\/p>\\r\\n<p>And a few steps away, near the chancel on the northeast side of the nave, stands Richard Upjohn\\u2019s beautiful and intricate brass filigree pulpit.<\\/p>\"}},\"122\":{\"type\":\"figure\",\"enabled\":\"1\",\"fields\":{\"image\":[\"216\"],\"altAttribute\":\"Richard Upjohn\\u2019s beautiful and intricate brass filigree pulpit\",\"caption\":\"<p>Richard Upjohn\\u2019s beautiful and intricate brass filigree pulpit<\\/p>\",\"enlarge\":\"1\",\"orientation\":\"horizontal\"}},\"126\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>How fortunate we are to have works by all three of these masters under the roof of the \\u201cLittle Church\\u201d.&nbsp; I will give thanks when December 16<sup>th<\\/sup>&nbsp;rolls around.<\\/p>\"}},\"218\":{\"type\":\"footnote\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p><em>Holy Women, Holy Men: Celebrating the Saints<\\/em> by Church Publishing Incorporated<\\/p>\"}}},\"25\":[\"205\"],\"26\":\"Mary Jane Gocher\",\"27\":\"Corey Schneider\"}}', '2017-08-31 12:02:49', '2017-08-31 12:02:49', '44d9b119-96ee-421d-a2b4-4add840cd1fa'),
 ('85', '69', '7', '1', 'en_us', '38', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Welcome\",\"slug\":\"welcome\",\"postDate\":1503746520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"Welcome to our little church\",\"13\":{\"71\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>First time here?<\\/h2>\\r\\n<p>I invite you to join us in worship and fellowship at any one of our services, coffee hour, concert series, or a simple contemplative visit to our garden and chapel. I like to think of our parish as a quiet oasis in the heart of this vibrant city. And yet we have so much going on at our Little Church.<\\/p>\"}}},\"11\":[\"207\"],\"12\":\"<p>Greetings and welcome to the Church of the Transfiguration, also known affectionately as the \\u201cLittle Church Around the Corner\\u201d.<\\/p>\\r\\n<p>Our parish combines the beauty and depth of the Anglo-Catholic tradition with the warmth of a dear community of people seeking the presence of Christ in the center of the NoMad neighborhood in Manhattan.<\\/p>\\r\\n<p>From the time of our founding in the mid 19th century, our motto has remained Fides Opera (Faith & Works).&nbsp; Our faith is expressed in the depth of resplendent worship, offering our very best in praise of God in the person of Jesus Christ.&nbsp; And from this worship flows an outward ministry of works to a city and world crying for mindful and responsive hands, feet, and hearts. &nbsp;<\\/p>\\r\\n<p>\\u201cIn God, that which is ancient never becomes old,\\u201d and we embrace this sentiment combining traditional liturgical worship with a radical inclusiveness deeply rooted in our parish\\u2019s history and celebrated by a vibrant diocese in which we serve.&nbsp; Please consider this parish as you look for a spiritual home.&nbsp; All are welcome.<\\/p>\\r\\n<p>With loving wishes,&nbsp;<\\/p>\\r\\n<p>Fr. John David van Dooren<br>Rector<\\/p>\\r\\n<p><br><\\/p>\",\"27\":\"Meghan Joseph\"}}', '2017-08-31 12:09:11', '2017-08-31 12:09:11', '1fc26a65-38d5-4ea9-9564-50a5a12528bc'),
 ('86', '69', '7', '1', 'en_us', '39', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Welcome\",\"slug\":\"welcome\",\"postDate\":1503746520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"Welcome to our little church\",\"13\":{\"71\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>First time here?<\\/h2>\\r\\n<p>I invite you to join us in worship and fellowship at any one of our services, coffee hour, concert series, or a simple contemplative visit to our garden and chapel. I like to think of our parish as a quiet oasis in the heart of this vibrant city. And yet we have so much going on at our Little Church.<\\/p>\"}}},\"11\":[\"207\"],\"12\":\"<p>Greetings and welcome to the Church of the Transfiguration, also known affectionately as the \\u201cLittle Church Around the Corner\\u201d.<\\/p>\",\"27\":\"Meghan Joseph\"}}', '2017-08-31 12:09:51', '2017-08-31 12:09:51', '4e508dbc-0788-4227-b2d7-97f5fc7e3a33'),
 ('87', '69', '7', '1', 'en_us', '40', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Welcome\",\"slug\":\"welcome\",\"postDate\":1503746520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"Welcome to our little church\",\"13\":{\"71\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>Our parish combines the beauty and depth of the Anglo-Catholic tradition with the warmth of a dear community of people seeking the presence of Christ in the center of the NoMad neighborhood in Manhattan. &nbsp;<br><\\/p>\\r\\n<p>From the time of our founding in the mid 19th century, our motto has remained Fides Opera (Faith & Works).&nbsp; Our faith is expressed in the depth of resplendent worship, offering our very best in praise of God in the person of Jesus Christ.&nbsp; And from this worship flows an outward ministry of works to a city and world crying for mindful and responsive hands, feet, and hearts. &nbsp;<\\/p>\\r\\n<p>\\u201cIn God, that which is ancient never becomes old,\\u201d and we embrace this sentiment combining traditional liturgical worship with a radical inclusiveness deeply rooted in our parish\\u2019s history and celebrated by a vibrant diocese in which we serve.&nbsp; Please consider this parish as you look for a spiritual home. All are welcome.<\\/p>\\r\\n<p>With loving wishes,&nbsp;<\\/p>\\r\\n<p>Fr. John David van Dooren<br>Rector<\\/p>\"}}},\"11\":[\"207\"],\"12\":\"<p>Greetings and welcome to the Church of the Transfiguration, also known affectionately as the \\u201cLittle Church Around the Corner\\u201d.<\\/p>\",\"27\":\"Meghan Joseph\"}}', '2017-08-31 12:11:02', '2017-08-31 12:11:02', '055063bb-9746-49e6-834f-e29545cce832'),
