 ('90', '69', '7', '1', 'en_us', '43', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Welcome\",\"slug\":\"welcome\",\"postDate\":1503746520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"Welcome to our little church\",\"13\":{\"71\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>Faith and Works<\\/h2><p>From the time of our founding in the mid 19th century, our motto has remained Fides Opera (Faith and Works). Our faith is expressed in the depth of resplendent worship, offering our very best in praise of God in the person of Jesus Christ. From this worship flows an outward ministry of works to a city and world crying for mindful and responsive hands, feet, and hearts. &nbsp;<\\/p>\\r\\n<p>\\u201cIn God, that which is ancient never becomes old,\\u201d and we embrace this sentiment combining traditional liturgical worship with a radical inclusiveness deeply rooted in our parish\\u2019s history and celebrated by a vibrant diocese in which we serve.&nbsp; Please consider this parish as you look for a spiritual home. All are welcome.<\\/p>\\r\\n<p>With loving wishes,&nbsp;<\\/p>\\r\\n<p>Fr. John David van Dooren<br>Rector<\\/p>\"}}},\"11\":[\"207\"],\"12\":\"<p>Greetings and welcome to the Church of the Transfiguration, also known affectionately as the \\u201cLittle Church Around the Corner\\u201d.&nbsp;Our parish combines the beauty and depth of the Anglo-Catholic tradition with the warmth of a dear community of people seeking the presence of Christ in the center of the NoMad neighborhood in Manhattan.<\\/p>\",\"27\":\"Meghan Joseph\"}}', '2017-08-31 12:14:10', '2017-08-31 12:14:10', '4678910d-9574-42a5-b660-10e2c8bdb34e'),
 ('91', '115', '9', '1', 'en_us', '4', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"Do All Dogs Go To Heaven?\",\"slug\":\"this-is-another-article\",\"postDate\":1504137600,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"28\":{\"116\":{\"type\":\"paragraph\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>Sem natoque nulla ligula ullamcorper facilisi semper conubia inceptos a risus aptent egestas dictumst vulputate at ultrices fermentum pretium hendrerit ad a. Suspendisse tristique consequat torquent ipsum hac cum a at ac at phasellus id fringilla dis risus auctor himenaeos parturient ac vestibulum dis faucibus litora. Ultrices et facilisi neque suscipit ad torquent convallis cras nisl condimentum a suspendisse felis vestibulum ridiculus suscipit nunc dapibus ac velit a.&nbsp;<\\/p>\\r\\n<p>Eleifend ut vivamus parturient hendrerit est parturient a nec elit a ante nec adipiscing condimentum velit montes metus eu sagittis enim. Turpis a diam ultricies arcu curabitur dignissim eleifend non aliquam interdum ad nulla tincidunt aenean aptent fringilla consectetur primis neque. Id scelerisque laoreet ad scelerisque ligula ut vestibulum praesent cras a habitant consectetur purus parturient. Eu laoreet nam in hac inceptos in hendrerit lobortis sociosqu cum elit aliquam condimentum ad a.&nbsp;<\\/p>\\r\\n<p>Vestibulum mi parturient auctor lectus suscipit curae litora lectus condimentum cubilia dui porttitor blandit ut. Faucibus penatibus a eros etiam pulvinar ultricies in a egestas vestibulum cum massa quisque interdum. Ullamcorper vestibulum parturient et mattis mi parturient sagittis praesent morbi netus condimentum fermentum ullamcorper ligula ante molestie hac phasellus facilisi class mattis blandit urna ridiculus ante magnis sociosqu a. Aliquet turpis ligula eros ad parturient parturient malesuada penatibus aliquet mi adipiscing ad pulvinar cubilia scelerisque laoreet penatibus vivamus a a scelerisque. Parturient ad massa cum nisi senectus massa taciti vestibulum accumsan magna in parturient nibh odio. A mi velit erat ullamcorper rutrum lacus vestibulum donec sit duis maecenas nam hendrerit gravida sed turpis enim scelerisque senectus laoreet quam lectus id adipiscing.&nbsp;<\\/p>\\r\\n<p>Habitasse vestibulum odio scelerisque eu dolor condimentum ornare urna dictumst velit a consectetur nisi parturient quisque scelerisque morbi vitae mus penatibus sociosqu nec eget at vestibulum feugiat interdum nascetur. Suscipit tortor purus semper sodales leo id vestibulum adipiscing montes adipiscing sed curae sodales porta nisi senectus mi conubia euismod senectus. Arcu eleifend suspendisse sociosqu velit laoreet a potenti risus justo suspendisse a vestibulum curabitur vel torquent a vehicula et tincidunt. Aliquet a malesuada parturient et potenti inceptos nec natoque sem scelerisque scelerisque nibh conubia condimentum nascetur phasellus. Torquent placerat a suspendisse sagittis vestibulum mi volutpat ultrices sed nam sagittis sociosqu dolor eget convallis sociis accumsan at.&nbsp;<\\/p>\\r\\n<p>Adipiscing parturient ad condimentum at a ac lacus montes rhoncus arcu vel condimentum magnis venenatis praesent sem scelerisque dis eleifend urna gravida a ullamcorper a nisi ullamcorper sed lacus. Natoque vel nullam curabitur eu sem eu purus suspendisse et accumsan scelerisque adipiscing sit adipiscing suspendisse consectetur lacinia sociis commodo vestibulum natoque egestas. Ut faucibus fringilla habitasse elementum odio euismod adipiscing varius massa in parturient a gravida nostra sit.&nbsp;<\\/p>\\r\\n<p>Facilisi parturient tempus parturient interdum leo dis ullamcorper scelerisque odio vulputate feugiat suspendisse a eu varius hac diam neque phasellus tempor. Aenean maecenas a neque sed a a tortor vestibulum ad eu aptent consectetur nullam tortor. Vestibulum facilisis pharetra imperdiet nullam rutrum sem suspendisse a litora a id eu lacinia elit mus morbi a in in sociosqu ad in id torquent sodales.<\\/p>\"}}},\"25\":\"\",