 ('108', '239', '7', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Parish Life\",\"slug\":\"parish-life\",\"postDate\":1504211776,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"new1\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p><span class=\\\"aBn\\\" data-term=\\\"goog_1238699488\\\" tabindex=\\\"0\\\">Sunday<\\/span>&nbsp;Coffee Hours also afford parishioners and newcomers opportunities to interact and to build relationships that often result in invitations to break bread or to take advantage of the many cultural events in New York.&nbsp; Fundraisers, like our Spring Music Gala, are also a great way to interact with fellow parishioners and to enjoy the talent and hospitality of our parish.<\\/p>\\r\\n<p>Sign up for our&nbsp;<a href=\\\"http:\\/\\/lc-craft\\/grace\\/entries\\/about\\/new#\\\">weekly&nbsp;Friday&nbsp;blasts<\\/a>&nbsp;and check&nbsp;<a href=\\\"http:\\/\\/lc-craft\\/grace\\/entries\\/about\\/new#\\\">our calendar<\\/a><span class=\\\"redactor-unlink\\\"><\\/span>&nbsp;for upcoming events and opportunities to participate in the robust Parish Life of Church of the Transfiguration.<\\/p><p><\\/p>\"}}},\"11\":[\"238\"],\"12\":\"<p>Building community is an important part of Church of the Transfiguration both spiritually and socially.&nbsp; Many of our parishioners gather each week&nbsp;<span class=\\\"aBn\\\" data-term=\\\"goog_1238699486\\\" tabindex=\\\"0\\\"><span class=\\\"aQJ\\\">on Thursday<\\/span><\\/span>&nbsp;to participate in worship and Bible Study, while others enjoy going to a local restaurant after&nbsp;<span class=\\\"aBn\\\" data-term=\\\"goog_1238699487\\\" tabindex=\\\"0\\\"><span class=\\\"aQJ\\\">Sunday<\\/span><\\/span>&nbsp;mass to enjoy brunch and social fellowship.<\\/p>\",\"27\":\"\"}}', '2017-08-31 20:36:16', '2017-08-31 20:36:16', '36f59dec-6af5-47d9-95b9-6ca6cfad0339'),
