 ('112', '239', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Parish Life\",\"slug\":\"parish-life\",\"postDate\":1504211760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"240\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>Sunday&nbsp;Coffee Hours also afford parishioners and newcomers opportunities to interact and to build relationships that often result in invitations to break bread or to take advantage of the many cultural events in New York. Fundraisers, like our Spring Music Gala, are also a great way to interact with fellow parishioners and to enjoy the talent and hospitality of our parish.<\\/p>\\r\\n<p>Sign up for our&nbsp;<a href=\\\"http:\\/\\/lc-craft\\/grace\\/entries\\/about\\/new#\\\">weekly&nbsp;Friday&nbsp;blasts<\\/a>&nbsp;and check&nbsp;<a href=\\\"http:\\/\\/lc-craft\\/grace\\/entries\\/about\\/new#\\\">our calendar<\\/a>&nbsp;for upcoming events and opportunities to participate in the robust Parish Life of Church of the Transfiguration.<\\/p>\"}}},\"11\":[\"238\"],\"12\":\"<p>Building community is an important part of Church of the Transfiguration both spiritually and socially. Many of our parishioners gather each week&nbsp;on Thursday&nbsp;to participate in worship and Bible Study, while others enjoy going to a local restaurant after&nbsp;Sunday&nbsp;mass to enjoy brunch and social fellowship.<\\/p>\",\"27\":\"\"}}', '2017-09-01 09:33:22', '2017-09-01 09:33:22', '291dbd98-854f-43fe-9e04-8964839fbc55'),
 ('113', '244', '10', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Whorship Schedule\",\"slug\":\"whorship-schedule\",\"postDate\":1504260795,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"new1\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>At the center of our worship is emphasis on both Word and Table. Little Church clergy are considered <a href=\\\"#\\\">excellent preachers<\\/a>&nbsp;who connect lectionary readings with Biblical context and current challenges with a smattering of personal stories and humor. Transfiguration acolytes do an extraordinary job in ensuring the Eucharist is celebrated with majesty and dignity, and the authentic expertise of <a href=\\\"#\\\">our choirs<\\/a>&nbsp;draws worshippers closer to the love of Jesus Christ through some of the most beloved hymns of the Church.<\\/p>\\r\\n<p>Below is the current worship schedule. Please consider joining us!<\\/p>\"}}},\"11\":[\"243\"],\"12\":\"<p>The cornerstone of Transfiguration\\u2019s spirituality is how we express and demonstrate God\\u2019s inclusive love through liturgy, music and worship. As an Anglo-Catholic parish, Transfiguration honors traditional liturgy with a full complement of meaningful preaching and music.<\\/p>\",\"27\":\"\"}}', '2017-09-01 10:13:16', '2017-09-01 10:13:16', '9a72c2e3-7c7c-48d6-a7c6-7f88e7bbb276'),
 ('114', '244', '10', '1', 'en_us', '2', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Worship Schedule\",\"slug\":\"whorship-schedule\",\"postDate\":1504260780,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"245\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>At the center of our worship is emphasis on both Word and Table. Little Church clergy are considered <a href=\\\"#\\\">excellent preachers<\\/a>&nbsp;who connect lectionary readings with Biblical context and current challenges with a smattering of personal stories and humor. Transfiguration acolytes do an extraordinary job in ensuring the Eucharist is celebrated with majesty and dignity, and the authentic expertise of <a href=\\\"#\\\">our choirs<\\/a>&nbsp;draws worshippers closer to the love of Jesus Christ through some of the most beloved hymns of the Church.<\\/p>\\r\\n<p>Below is the current worship schedule. Please consider joining us!<\\/p>\"}}},\"11\":[\"243\"],\"12\":\"<p>The cornerstone of Transfiguration\\u2019s spirituality is how we express and demonstrate God\\u2019s inclusive love through liturgy, music and worship. As an Anglo-Catholic parish, Transfiguration honors traditional liturgy with a full complement of meaningful preaching and music.<\\/p>\",\"27\":\"\"}}', '2017-09-01 10:13:37', '2017-09-01 10:13:37', '2af9c9cc-81ac-444d-89f7-b95224281972'),
 ('115', '244', '10', '1', 'en_us', '3', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Worship Schedule\",\"slug\":\"worship-schedule\",\"postDate\":1504260780,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"245\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>At the center of our worship is emphasis on both Word and Table. Little Church clergy are considered <a href=\\\"#\\\">excellent preachers<\\/a>&nbsp;who connect lectionary readings with Biblical context and current challenges with a smattering of personal stories and humor. Transfiguration acolytes do an extraordinary job in ensuring the Eucharist is celebrated with majesty and dignity, and the authentic expertise of <a href=\\\"#\\\">our choirs<\\/a>&nbsp;draws worshippers closer to the love of Jesus Christ through some of the most beloved hymns of the Church.<\\/p>\\r\\n<p>Below is the current worship schedule. Please consider joining us!<\\/p>\"}}},\"11\":[\"243\"],\"12\":\"<p>The cornerstone of Transfiguration\\u2019s spirituality is how we express and demonstrate God\\u2019s inclusive love through liturgy, music and worship. As an Anglo-Catholic parish, Transfiguration honors traditional liturgy with a full complement of meaningful preaching and music.<\\/p>\",\"27\":\"\"}}', '2017-09-01 10:13:45', '2017-09-01 10:13:45', '35f826fc-7a14-4b68-b763-04d6bdf4e1f6'),
 ('116', '244', '10', '1', 'en_us', '4', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Worship Schedule\",\"slug\":\"worship-schedule\",\"postDate\":1504260780,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"245\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>At the center of our worship is emphasis on both Word and Table. Little Church clergy are considered <a href=\\\"#\\\">excellent preachers<\\/a>&nbsp;who connect lectionary readings with Biblical context and current challenges with a smattering of personal stories and humor. Transfiguration acolytes do an extraordinary job in ensuring the Eucharist is celebrated with majesty and dignity, and the authentic expertise of <a href=\\\"#\\\">our choirs<\\/a>&nbsp;draws worshippers closer to the love of Jesus Christ through some of the most beloved hymns of the Church.<\\/p>\\r\\n<p>Below is the current worship schedule. Please consider joining us!<\\/p>\"}}},\"11\":[\"243\"],\"12\":\"<p>The cornerstone of Transfiguration\\u2019s spirituality is how we express and demonstrate God\\u2019s inclusive love through liturgy, music and worship. As an Anglo-Catholic parish, Transfiguration honors traditional liturgy with a full complement of meaningful preaching and music.<\\/p>\",\"27\":\"\"}}', '2017-09-01 10:13:52', '2017-09-01 10:13:52', 'ebadf824-1e08-4abc-93df-29ac63bbc34c'),
 ('117', '234', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Our History\",\"slug\":\"our-history\",\"postDate\":1504211220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"236\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Civil War<\\/h2><p><span class=\\\"s1\\\" <the=\\\"\\\" parish=\\\"\\\" had=\\\"\\\" only=\\\"\\\" been=\\\"\\\" established=\\\"\\\" for=\\\"\\\" a=\\\"\\\" few=\\\"\\\" years,=\\\"\\\" when=\\\"\\\" the=\\\"\\\" civil=\\\"\\\" war=\\\"\\\" broke=\\\"\\\" out.=\\\"\\\">span class=\\\"Apple-converted-space\\\"&gt;&nbsp; <\\/span>During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north.<span class=\\\"Apple-converted-space\\\">&nbsp; <\\/span>It was a place of refuge for African Americans during the New York Draft Riots of 1863 --three days of lawlessness, destruction, bloodshed, and lynchings.<\\/p>\\r\\n\"}}},\"11\":[\"235\"],\"12\":\"<p><span class=\\\"s1\\\">The Civil War<\\/span><\\/p><p><span class=\\\"s1\\\">The parish had only been established for a few years, when the Civil War broke out. &nbsp;During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north. &nbsp;It was a place of refuge for African Americans during the New York Draft Riots of 1863&mdash;three days of lawlessness, destruction, bloodshed, and lynchings.<\\/span><\\/p>\",\"27\":\"\"}}', '2017-09-04 20:45:14', '2017-09-04 20:45:14', 'd5110712-b60e-41f0-beee-cf09830639dd'),
 ('118', '234', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"A Brief History\",\"slug\":\"our-history\",\"postDate\":1504211220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"236\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Civil War<\\/h2>\\r\\n<p>span class=\\\"Apple-converted-space\\\"&gt;&nbsp; During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north.&nbsp; It was a place of refuge for African Americans during the New York Draft Riots of 1863 --three days of lawlessness, destruction, bloodshed, and lynchings.<\\/p>\"}}},\"11\":[\"235\"],\"12\":\"<p>Church of the Transfiguration parish was founded in 1848. &nbsp;The building itself dates from 1850; it was made a national landmark in 1973. &nbsp;The founder, the Rev. Dr. George Hendric Houghton wanted to build a church that would serve the needs of the poor and marginalized, and would welcome all regardless of race, class or background.<\\/p>\",\"27\":\"\"}}', '2017-09-04 20:47:46', '2017-09-04 20:47:46', '08a3212e-6f8b-4df0-aa41-d81e9749f0bd'),
 ('119', '234', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"A Brief History\",\"slug\":\"our-history\",\"postDate\":1504211220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"236\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Civil War<\\/h2><p>The parish had only been established for a few years, when the Civil War broke out. &nbsp;During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north. &nbsp;It was a place of refuge for African Americans during the New York Draft Riots of 1863&mdash;three days of lawlessness, destruction, bloodshed, and lynchings<\\/p>\"}}},\"11\":[\"235\"],\"12\":\"<p>Church of the Transfiguration parish was founded in 1848. &nbsp;The building itself dates from 1850; it was made a national landmark in 1973. &nbsp;The founder, the Rev. Dr. George Hendric Houghton wanted to build a church that would serve the needs of the poor and marginalized, and would welcome all regardless of race, class or background.<\\/p>\",\"27\":\"\"}}', '2017-09-04 20:48:57', '2017-09-04 20:48:57', 'be909ff5-c873-4568-86b3-f9da956a2419'),
 ('120', '234', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"A Brief History\",\"slug\":\"our-history\",\"postDate\":1504211220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"236\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Civil War<\\/h2>\\r\\n<p>The parish had only been established for a few years, when the Civil War broke out. &nbsp;During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north. It was a place of refuge for African Americans during the New York Draft Riots of 1863&mdash;three days of lawlessness, destruction, bloodshed, and lynchings.<\\/p>\"}}},\"11\":[\"235\"],\"12\":\"<p>Church of the Transfiguration parish was founded in 1848. &nbsp;The building itself dates from 1850; it was made a national landmark in 1973. &nbsp;The founder, the Rev. Dr. George Hendric Houghton wanted to build a church that would serve the needs of the poor and marginalized, and would welcome all regardless of race, class or background.<\\/p>\",\"27\":\"\"}}', '2017-09-04 20:49:59', '2017-09-04 20:49:59', '8913e68a-4e85-49aa-ba36-8cd9403f8a05'),
 ('121', '234', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"A Brief History\",\"slug\":\"our-history\",\"postDate\":1504211220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"236\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Civil War<\\/h2>\\r\\n<p>The parish had only been established for a few years, when the Civil War broke out. &nbsp;During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north. It was a place of refuge for African Americans during the New York Draft Riots of 1863&mdash;three days of lawlessness, destruction, bloodshed, and lynchings.<\\/p><h2>The Nickname<\\/h2><p>A few days before Christmas in 1890, Joseph Jefferson, an actor renowned for his portrayal of Rip Van Winkle, approached the rector of the now-defunct Church of the Atonement to request a funeral for his friend and fellow actor, George Holland. &nbsp;Upon learning that the deceased was an actor, the rector refused to hold a funeral for the man in his church. &nbsp;Joseph Jefferson persisted, and asked if there was a church in the area that would hold services for his friend. &nbsp;The rector said, \\u201cI believe there is a little church around the corner where it might be done.\\u201d &nbsp;Jefferson replied,&nbsp;<\\/p><blockquote>\\u201cThen I say to you, sir, God bless the little church around the corner.\\u201d<\\/blockquote>\"}}},\"11\":[\"235\"],\"12\":\"<blockquote>Church of the Transfiguration parish was founded in 1848. &nbsp;The building itself dates from 1850; it was made a national landmark in 1973. &nbsp;The founder, the Rev. Dr. George Hendric Houghton wanted to build a church that would serve the needs of the poor and marginalized, and would welcome all regardless of race, class or background.<\\/blockquote>\",\"27\":\"\"}}', '2017-09-04 20:51:38', '2017-09-04 20:51:38', '88ca2061-8b85-4ebd-be90-86faac1ad8fe'),
 ('122', '234', '7', '1', 'en_us', '8', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"A Brief History\",\"slug\":\"our-history\",\"postDate\":1504211220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"236\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Civil War<\\/h2>\\r\\n<p>The parish had only been established for a few years, when the Civil War broke out. &nbsp;During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north. It was a place of refuge for African Americans during the New York Draft Riots of 1863&mdash;three days of lawlessness, destruction, bloodshed, and lynchings.<\\/p>\\r\\n<h2>The Nickname<\\/h2>\\r\\n<p>A few days before Christmas in 1890, Joseph Jefferson, an actor renowned for his portrayal of Rip Van Winkle, approached the rector of the now-defunct Church of the Atonement to request a funeral for his friend and fellow actor, George Holland. &nbsp;Upon learning that the deceased was an actor, the rector refused to hold a funeral for the man in his church. &nbsp;Joseph Jefferson persisted, and asked if there was a church in the area that would hold services for his friend. &nbsp;The rector said, \\u201cI believe there is a little church around the corner where it might be done.\\u201d &nbsp;Jefferson replied,&nbsp;<\\/p>\\r\\n<blockquote>\\u201cThen I say to you, sir, God bless the little church around the corner.\\u201d<\\/blockquote>\"}}},\"11\":[\"235\"],\"12\":\"<p>Church of the Transfiguration parish was founded in 1848. &nbsp;The building itself dates from 1850; it was made a national landmark in 1973. &nbsp;The founder, the Rev. Dr. George Hendric Houghton wanted to build a church that would serve the needs of the poor and marginalized, and would welcome all regardless of race, class or background.<\\/p>\",\"27\":\"\"}}', '2017-09-04 20:51:54', '2017-09-04 20:51:54', '5b23d52a-f7c1-4ee3-930f-8a473ebee53c'),
 ('123', '234', '7', '1', 'en_us', '9', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"A Brief History\",\"slug\":\"our-history\",\"postDate\":1504211220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"236\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Civil War<\\/h2>\\r\\n<p>The parish had only been established for a few years, when the Civil War broke out. During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north. It was a place of refuge for African Americans during the New York Draft Riots of 1863&mdash;three days of lawlessness, destruction, bloodshed, and lynchings.<\\/p>\\r\\n<h2>The Nickname<\\/h2>\\r\\n<p>A few days before Christmas in 1890, Joseph Jefferson, an actor renowned for his portrayal of Rip Van Winkle, approached the rector of the now-defunct Church of the Atonement to request a funeral for his friend and fellow actor, George Holland. &nbsp;Upon learning that the deceased was an actor, the rector refused to hold a funeral for the man in his church. Joseph Jefferson persisted, and asked if there was a church in the area that would hold services for his friend. The rector said, \\u201cI believe there is a little church around the corner where it might be done.\\u201d Jefferson replied,&nbsp;<\\/p>\\r\\n<blockquote>\\u201cThen I say to you, sir, God bless the little church around the corner.\\u201d<\\/blockquote>\"}}},\"11\":[\"235\"],\"12\":\"<p>Church of the Transfiguration parish was founded in 1848. The building itself dates from 1850; it was made a national landmark in 1973. The founder, the Rev. Dr. George Hendric Houghton wanted to build a church that would serve the needs of the poor and marginalized, and would welcome all regardless of race, class or background.<\\/p>\",\"27\":\"\"}}', '2017-09-04 20:54:34', '2017-09-04 20:54:34', 'ef38c97e-e72c-4a84-bcf7-2d5d1aebabf0'),
