p>\",\"27\":\"\"}}', '2017-09-04 20:55:33', '2017-09-04 20:55:33', '9859281b-6119-4454-ac63-52f3b4b65fe5'),
 ('125', '234', '7', '1', 'en_us', '11', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"A Brief History\",\"slug\":\"our-history\",\"postDate\":1504211220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"236\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Civil War<\\/h2>\\r\\n<p>The parish had only been established for a few years, when the Civil War broke out. During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north. It was a place of refuge for African Americans during the New York Draft Riots of 1863&mdash;three days of lawlessness, destruction, bloodshed, and lynchings.<\\/p>\\r\\n<h2>The Nickname<\\/h2>\\r\\n<p>A few days before Christmas in 1890, Joseph Jefferson, an actor renowned for his portrayal of Rip Van Winkle, approached the rector of the now-defunct Church of the Atonement to request a funeral for his friend and fellow actor, George Holland. &nbsp;Upon learning that the deceased was an actor, the rector refused to hold a funeral for the man in his church. Joseph Jefferson persisted, and asked if there was a church in the area that would hold services for his friend. The rector said, \\u201cI believe there is a little church around the corner where it might be done.\\u201d Jefferson replied,&nbsp;<\\/p>\\r\\n<blockquote>\\u201cThen I say to you, sir, God bless the little church around the corner.\\u201d<\\/blockquote>\"}},\"269\":{\"type\":\"figureFull\",\"enabled\":\"1\",\"fields\":{\"image\":[\"204\"],\"altAttribute\":\"\",\"caption\":\"\",\"credit\":\"\"}},\"new1\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>The Theatre<\\/p>\\r\\n<p><span class=\\\"s1\\\">To this day, the church maintains close ties with the theater. It has served as the national headquarters of the Episcopal Actors\' Guild since its&nbsp;<\\/span>founding in 1923, by the third rector, Dr. Randolph Ray.<\\/p>\\r\\n<p><span class=\\\"s1\\\"><\\/span>\\r\\n<\\/p>\\r\\n<h2>Weddings<\\/h2><p>Our historic buildings and lovely garden have drawn couples from all over the world to be married here. These couples are members of the \\\"Little Family,\\\" and many have stayed in touch with us over the years.&nbsp;Continuing its long tradition of inclusiveness, the \\\"Little Church\\\" is proud to have celebrated the first same-sex wedding in the Diocese of New York in July 2012 and has performed several more since the formal rite of Blessing of a Lifelong Covenant was adopted by the General Convention.<\\/p>\\r\\n<p><span class=\\\"s1\\\"><\\/span>\\r\\n<\\/p>\\r\\n<p><span class=\\\"s1\\\">We invite you to stop by for a visit, join us in worship, or simply contact us for more information.<\\/span><\\/p>\"}}},\"11\":[\"235\"],\"12\":\"<p>Church of the Transfiguration parish was founded in 1848. The building itself dates from 1850; it was made a national landmark in 1973. The founder, the Rev. Dr. George Hendric Houghton wanted to build a church that would serve the needs of the poor and marginalized, and would welcome all regardless of race, class or background.<\\/p>\",\"27\":\"\"}}', '2017-09-04 20:56:38', '2017-09-04 20:56:38', 'f2abbede-792f-4b2e-a872-744c518e6ef8'),
 ('126', '239', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Parish Life\",\"slug\":\"parish-life\",\"postDate\":1504211760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"240\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>Sunday&nbsp;Coffee Hours also afford parishioners and newcomers opportunities to interact and to build relationships that often result in invitations to break bread or to take advantage of the many cultural events in New York. Fundraisers, like our Spring Music Gala, are also a great way to interact with fellow parishioners and to enjoy the talent and hospitality of our parish.<\\/p>\\r\\n<p>Sign up for our&nbsp;<a href=\\\"http:\\/\\/lc-craft\\/grace\\/entries\\/about\\/new#\\\">weekly&nbsp;Friday&nbsp;blasts<\\/a>&nbsp;and check&nbsp;<a href=\\\"http:\\/\\/lc-craft\\/grace\\/entries\\/about\\/new#\\\">our calendar<\\/a>&nbsp;for upcoming events and opportunities to participate in the robust Parish Life of Church of the Transfiguration.<\\/p>\"}}},\"11\":[\"238\"],\"12\":\"<p>Building community is an important part of Church of the Transfiguration both spiritually and socially. Many of our parishioners gather each week&nbsp;on Thursday&nbsp;to participate in worship and Bible Study, while others enjoy going to a local restaurant after&nbsp;Sunday&nbsp;mass to enjoy brunch and social fellowship.<\\/p>\",\"27\":\"\"}}', '2017-09-04 20:56:44', '2017-09-04 20:56:44', '95bcb00d-60ac-45d4-8c98-bb6f55637da4'),
 ('127', '234', '7', '1', 'en_us', '12', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"A Brief History\",\"slug\":\"our-history\",\"postDate\":1504211220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"236\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Civil War<\\/h2>\\r\\n<p>The parish had only been established for a few years, when the Civil War broke out. During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north. It was a place of refuge for African Americans during the New York Draft Riots of 1863&mdash;three days of lawlessness, destruction, bloodshed, and lynchings.<\\/p>\\r\\n<h2>The Nickname<\\/h2>\\r\\n<p>A few days before Christmas in 1890, Joseph Jefferson, an actor renowned for his portrayal of Rip Van Winkle, approached the rector of the now-defunct Church of the Atonement to request a funeral for his friend and fellow actor, George Holland. &nbsp;Upon learning that the deceased was an actor, the rector refused to hold a funeral for the man in his church. Joseph Jefferson persisted, and asked if there was a church in the area that would hold services for his friend. The rector said, \\u201cI believe there is a little church around the corner where it might be done.\\u201d Jefferson replied,&nbsp;<\\/p>\\r\\n<blockquote>\\u201cThen I say to you, sir, God bless the little church around the corner.\\u201d<\\/blockquote>\"}},\"269\":{\"type\":\"figureFull\",\"enabled\":\"1\",\"fields\":{\"image\":[\"204\"],\"altAttribute\":\"\",\"caption\":\"\",\"credit\":\"\"}},\"270\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Theatre<\\/h2>\\r\\n<p>To this day, the church maintains close ties with the theater. It has served as the national headquarters of the Episcopal Actors\' Guild since its&nbsp;founding in 1923, by the third rector, Dr. Randolph Ray.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<h2>Weddings<\\/h2>\\r\\n<p>Our historic buildings and lovely garden have drawn couples from all over the world to be married here. These couples are members of the \\\"Little Family,\\\" and many have stayed in touch with us over the years.&nbsp;Continuing its long tradition of inclusiveness, the \\\"Little Church\\\" is proud to have celebrated the first same-sex wedding in the Diocese of New York in July 2012 and has performed several more since the formal rite of Blessing of a Lifelong Covenant was adopted by the General Convention.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>We invite you to stop by for a visit, join us in worship, or simply contact us for more information.<\\/p>\"}}},\"11\":[\"235\"],\"12\":\"<p>Church of the Transfiguration parish was founded in 1848. The building itself dates from 1850; it was made a national landmark in 1973. The founder, the Rev. Dr. George Hendric Houghton wanted to build a church that would serve the needs of the poor and marginalized, and would welcome all regardless of race, class or background.<\\/p>\",\"27\":\"\"}}', '2017-09-04 20:57:19', '2017-09-04 20:57:19', 'f5fb4b85-3f9e-4f06-8c74-001cf14478f6'),
 ('128', '234', '7', '1', 'en_us', '13', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"A Brief History\",\"slug\":\"our-history\",\"postDate\":1504211220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"236\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Civil War<\\/h2>\\r\\n<p>The parish had only been established for a few years, when the Civil War broke out. During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north. It was a place of refuge for African Americans during the New York Draft Riots of 1863&mdash;three days of lawlessness, destruction, bloodshed, and lynchings.<\\/p>\\r\\n<h2>The Nickname<\\/h2>\\r\\n<p>A few days before Christmas in 1890, Joseph Jefferson, an actor renowned for his portrayal of Rip Van Winkle, approached the rector of the now-defunct Church of the Atonement to request a funeral for his friend and fellow actor, George Holland. &nbsp;Upon learning that the deceased was an actor, the rector refused to hold a funeral for the man in his church. Joseph Jefferson persisted, and asked if there was a church in the area that would hold services for his friend. The rector said, \\u201cI believe there is a little church around the corner where it might be done.\\u201d Jefferson replied,&nbsp;<\\/p>\\r\\n<blockquote>\\u201cThen I say to you, sir, God bless the little church around the corner.\\u201d<\\/blockquote>\"}},\"269\":{\"type\":\"figureFull\",\"enabled\":\"1\",\"fields\":{\"image\":[\"204\"],\"altAttribute\":\"\",\"caption\":\"\",\"credit\":\"\"}},\"270\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Theatre<\\/h2>\\r\\n<p>To this day, the church maintains close ties with the theater. It has served as the national headquarters of the Episcopal Actors\' Guild since its&nbsp;founding in 1923, by the third rector, Dr. Randolph Ray.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<h2>Weddings<\\/h2>\\r\\n<p>Our historic buildings and lovely garden have drawn couples from all over the world to be married here. These couples are members of the \\\"Little Family,\\\" and many have stayed in touch with us over the years.&nbsp;Continuing its long tradition of inclusiveness, the \\\"Little Church\\\" is proud to have celebrated the first same-sex wedding in the Diocese of New York in July 2012 and has performed several more since the formal rite of Blessing of a Lifelong Covenant was adopted by the General Convention.<\\/p>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>We invite you to stop by for a <a href=\\\"#\\\">visit<\\/a>, join us in <a href=\\\"http:\\/\\/lc-craft\\/worship\\/worship-schedule#entry:244\\\">worship<\\/a>, or simply contact us for more information.<\\/p>\"}}},\"11\":[\"235\"],\"12\":\"<p>Church of the Transfiguration parish was founded in 1848. The building itself dates from 1850; it was made a national landmark in 1973. The founder, the Rev. Dr. George Hendric Houghton wanted to build a church that would serve the needs of the poor and marginalized, and would welcome all regardless of race, class or background.<\\/p>\",\"27\":\"\"}}', '2017-09-04 20:58:26', '2017-09-04 20:58:26', 'f3d78b72-fae3-4441-9ab6-fb8f8218f209'),
 ('129', '271', '7', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Outreach\",\"slug\":\"outreach\",\"postDate\":1504623411,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":\"\",\"11\":\"\",\"12\":\"<h2>Ecclesia Ministries<\\/h2><p>takes religious services to the homeless in Madison Square Park. It is a cooperative program supported by various churches and clergy in the NoMad (North of Madison Square Park) area. Transfiguration is one of those congregations; it is also the alternate location when inclement weather makes an outdoor service impractical. Last Christmas, our parishioners donated an abundance of warm gloves, scarves, gloves, hats, long underwear, and other items to people served by Ecclesia Ministries.<\\/p><p><\\/p>\",\"27\":\"\"}}', '2017-09-05 14:56:51', '2017-09-05 14:56:51', '783f958c-ff9c-4fa5-8f10-610bf397dcea'),
 ('130', '271', '7', '1', 'en_us', '2', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Outreach\",\"slug\":\"outreach\",\"postDate\":1504623360,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"new1\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>Ecclesia Ministries<\\/h2>\\r\\n<p>takes religious services to the homeless in Madison Square Park. It is a cooperative program supported by various churches and clergy in the NoMad (North of Madison Square Park) area. Transfiguration is one of those congregations; it is also the alternate location when inclement weather makes an outdoor service impractical. Last Christmas, our parishioners donated an abundance of warm gloves, scarves, gloves, hats, long underwear, and other items to people served by Ecclesia Ministries.<\\/p>\"}}},\"11\":\"\",\"12\":\"<h2><\\/h2>\",\"27\":\"\"}}', '2017-09-05 15:02:17', '2017-09-05 15:02:17', '67eeb4bb-9c4b-4a17-a2aa-b3d07893cf32'),
 ('131', '271', '7', '1', 'en_us', '3', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Outreach\",\"slug\":\"outreach\",\"postDate\":1504623360,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"272\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p><a href=\\\"#\\\"><strong>Ecclesia Ministries<\\/strong><\\/a><strong><\\/strong> takes religious services to the homeless in Madison Square Park. It is a cooperative program supported by various churches and clergy in the NoMad (North of Madison Square Park) area. Transfiguration is one of those congregations; it is also the alternate location when inclement weather makes an outdoor service impractical. Last Christmas, our parishioners donated an abundance of warm gloves, scarves, gloves, hats, long underwear, and other items to people served by Ecclesia Ministries.<\\/p><p><strong><a href=\\\"#\\\">The Episcopal Actors Guild<\\/a>&nbsp;<\\/strong>was founded in 1923 by our third rector,&nbsp;the Rev. Dr. Randolph Ray to bridge the worlds of church and theater. Today,&nbsp;the Guild is a philanthropic organization that raises money and dispenses&nbsp;emergency funds to members of the acting profession facing severe financial&nbsp;hardship. It also has entertainment programs, educational, career development&nbsp;and social events for its members.<\\/p><p>Each November, the Guild holds a memorial service in the church dedicated to members of the profession who died in the previous year. In December, they present a Service of Lessons and Carols with outstanding music, often performed by Broadway veterans. Both events are open to the public.<\\/p><p><br><\\/p>\"}}},\"11\":\"\",\"12\":\"\",\"27\":\"\"}}', '2017-09-05 15:08:31', '2017-09-05 15:08:31', 'bd180617-caf0-4940-9d1b-b0d06ed681f8'),
 ('132', '271', '7', '1', 'en_us', '4', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Outreach\",\"slug\":\"outreach\",\"postDate\":1504623360,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"272\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>Ecclesia Ministries<\\/h2><p><strong><a href=\\\"#\\\">Ecclesia Ministries<\\/a><\\/strong> takes religious services to the homeless in Madison Square Park. It is a cooperative program supported by various churches and clergy in the NoMad (North of Madison Square Park) area. Transfiguration is one of those congregations; it is also the alternate location when inclement weather makes an outdoor service impractical. Last Christmas, our parishioners donated an abundance of warm gloves, scarves, gloves, hats, long underwear, and other items to people served by Ecclesia Ministries.<\\/p><h2>The Episcopal Actors Guild<\\/h2>\\r\\n<p><strong><a href=\\\"#\\\">The Episcopal Actors Guild<\\/a>&nbsp;<\\/strong>was founded in 1923 by our third rector,&nbsp;the Rev. Dr. Randolph Ray to bridge the worlds of church and theater. Today,&nbsp;the Guild is a philanthropic organization that raises money and dispenses&nbsp;emergency funds to members of the acting profession facing severe financial&nbsp;hardship. It also has entertainment programs, educational, career development&nbsp;and social events for its members.<\\/p>\\r\\n<p>Each November, the Guild holds a memorial service in the church dedicated to members of the profession who died in the previous year. In December, they present a Service of Lessons and Carols with outstanding music, often performed by Broadway veterans. Both events are open to the public.<\\/p><p><br><\\/p><h3>Actor\\u2019s Pantry Food Bank<\\/h3><p><\\/p><p>Our parishioners support the Episcopal Actors Guild\\u2019s Actors Pantry (hyperlink)<br>program. Each Sunday, we collect non-perishable food. The Guild then fills<br>bags with the donated items and gives them to artists in need who have applied<br>to the Guild for help. No one leaves empty-handed.<\\/p>\\r\\n<p><br><\\/p>\"}}},\"11\":\"\",\"12\":\"\",\"27\":\"\"}}', '2017-09-05 15:14:30', '2017-09-05 15:14:30', 'c336488a-c9e3-4719-836e-c687d77a87ac'),
 ('133', '271', '7', '1', 'en_us', '5', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Outreach\",\"slug\":\"outreach\",\"postDate\":1504623360,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"272\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>Ecclesia Ministries<\\/h2>\\r\\n<p><strong><a href=\\\"#\\\">Ecclesia Ministries<\\/a><\\/strong> takes religious services to the homeless in Madison Square Park. It is a cooperative program supported by various churches and clergy in the NoMad (North of Madison Square Park) area. Transfiguration is one of those congregations; it is also the alternate location when inclement weather makes an outdoor service impractical. Last Christmas, our parishioners donated an abundance of warm gloves, scarves, gloves, hats, long underwear, and other items to people served by Ecclesia Ministries.<\\/p>\\r\\n<h2>The Episcopal Actors Guild<\\/h2>\\r\\n<p><strong><a href=\\\"#\\\">The Episcopal Actors Guild<\\/a>&nbsp;<\\/strong>was founded in 1923 by our third rector,&nbsp;the Rev. Dr. Randolph Ray to bridge the worlds of church and theater. Today,&nbsp;the Guild is a philanthropic organization that raises money and dispenses&nbsp;emergency funds to members of the acting profession facing severe financial&nbsp;hardship. It also has entertainment programs, educational, career development&nbsp;and social events for its members.<\\/p>\\r\\n<p>Each November, the Guild holds a memorial service in the church dedicated to members of the profession who died in the previous year. In December, they present a Service of Lessons and Carols with outstanding music, often performed by Broadway veterans. Both events are open to the public.<\\/p>\\r\\n<h3>Actor\\u2019s Pantry Food Bank<\\/h3>\\r\\n<p>Our parishioners support the Episcopal Actors Guild\\u2019s Actors Pantry (hyperlink) program. Each Sunday, we collect non-perishable food. The Guild then fills bags with the donated items and gives them to artists in need who have applied to the Guild for help. No one leaves empty-handed.<\\/p>\"}}},\"11\":\"\",\"12\":\"\",\"27\":\"\"}}', '2017-09-06 16:30:07', '2017-09-06 16:30:07', 'ab407756-0944-4194-a6ee-36bbbaadce1a'),
 ('135', '239', '7', '1', 'en_us', '7', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Parish Life\",\"slug\":\"parish-life\",\"postDate\":1504211760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"240\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>Coffee, conversation, and culture<\\/h2><p>Sunday&nbsp;Coffee Hours also afford parishioners and newcomers opportunities to interact and to build relationships that often result in invitations to break bread or to take advantage of the many cultural events in New York. Fundraisers, like our Spring Music Gala, are also a great way to interact with fellow parishioners and to enjoy the talent and hospitality of our parish.<\\/p>\\r\\n<p>Sign up for our&nbsp;<a href=\\\"http:\\/\\/lc-craft\\/grace\\/entries\\/about\\/new#\\\">weekly&nbsp;Friday&nbsp;blasts<\\/a>&nbsp;and check&nbsp;<a href=\\\"http:\\/\\/lc-craft\\/grace\\/entries\\/about\\/new#\\\">our calendar<\\/a>&nbsp;for upcoming events and opportunities to participate in the robust Parish Life of Church of the Transfiguration.<\\/p>\"}}},\"11\":[\"238\"],\"12\":\"<p>Building community is an important part of Church of the Transfiguration both spiritually and socially. Many of our parishioners gather each week&nbsp;on Thursday&nbsp;to participate in worship and Bible Study, while others enjoy going to a local restaurant after&nbsp;Sunday&nbsp;mass to enjoy brunch and social fellowship.<\\/p>\",\"27\":\"\"}}', '2017-09-06 16:54:15', '2017-09-06 16:54:15', 'b9e0d79b-6e05-43c6-be40-d6d90d49b0a0'),
