 ('160', '244', '10', '1', 'en_us', '5', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Worship Schedule\",\"slug\":\"worship-schedule\",\"postDate\":1504260780,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"245\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<p>At the center of our worship is emphasis on both Word and Table. Little Church clergy are considered <a href=\\\"#\\\">excellent preachers<\\/a>&nbsp;who connect lectionary readings with Biblical context and current challenges with a smattering of personal stories and humor. Transfiguration acolytes do an extraordinary job in ensuring the Eucharist is celebrated with majesty and dignity, and the authentic expertise of <a href=\\\"#\\\">our choirs<\\/a>&nbsp;draws worshippers closer to the love of Jesus Christ through some of the most beloved hymns of the Church.&nbsp;Below is the current worship schedule. Please consider joining us<\\/p><h2>Worship Schedule<\\/h2>\"}}},\"11\":[\"243\"],\"12\":\"<p>The cornerstone of Transfiguration\\u2019s spirituality is how we express and demonstrate God\\u2019s inclusive love through liturgy, music and worship. As an Anglo-Catholic parish, Transfiguration honors traditional liturgy with a full complement of meaningful preaching and music.<\\/p>\",\"27\":\"\"}}', '2017-09-14 19:22:37', '2017-09-14 19:22:37', '2c821006-cb7f-43ec-8b35-a230ff144b68'),
