 ('168', '363', '10', '1', 'en_us', '2', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Weddings\",\"slug\":\"weddings\",\"postDate\":1505423640,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":\"\",\"11\":[\"362\"],\"12\":\"<p>Congratulations on your engagement, and thanks for your interest in becoming married at The Church of the Transfiguration. Our little church is a beautiful place with a century-old reputation for marrying couples from all over the world. At one time, Transfiguration solemnized more marriages than any other church! We welcome you to join in our story, and we hope to become a part of yours.<\\/p>\",\"27\":\"Jesse Anders \\/On Point Images \"}}', '2017-09-14 21:20:05', '2017-09-14 21:20:05', 'e313d03a-6f3d-4fac-b2d8-a2ebdfcc47c8'),
 ('169', '363', '10', '1', 'en_us', '3', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Weddings\",\"slug\":\"weddings\",\"postDate\":1505423640,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"new1\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>Weddings at Transfiguration<\\/h2>\\r\\n<p>How Transfiguration became famous as a place to exchange vows remains something of a mystery, but it is generally attributed to the overall openness of the church to people from different Christian denominations, personal situations and backgrounds. Every Saturday in&nbsp;<a href=\\\"https:\\/\\/www.nytimes.com\\/interactive\\/projects\\/cp\\/weddings\\/165-years-of-wedding-announcements\\/world-war-two-weddings\\\" target=\\\"_blank\\\">the 1930s and 40s<\\/a>&mdash;and often on weekdays&mdash;couples would gather in the garden, awaiting their turn to be married in the Holy Family Chapel. The Rector in that era would marry as many as <strong>seven couples a day<\\/strong>.<br><\\/p>\\r\\n<p>We hear from those couples to this day as part of our&nbsp;<em>Little Family<\\/em>&nbsp;community.&nbsp;We send out several newsletters to them each year and a card goes to all those married here on their anniversaries.<\\/p>\\r\\n<h3>The Space<\\/h3>\\r\\n<p>Tucked behind a lovely English garden with a fountain, Transfiguration is a neo-Gothic church rich with architectural detail. There are two spaces in which you may choose to be married:<\\/p>\\r\\n<p><strong>The Holy Family Chapel<\\/strong> is a quaint room panelled with dark wood that seats up to 50 people&mdash;is appropriate for smaller weddings. The altar piece is a painted depiction of the betrothal of Mary and Joseph. It is in the Holy Family Chapel that thousands of couples in the post-war years became married, making the Little Church famous for weddings.<\\/p><p><em>I can fill this out further, tomorrow, Mary Jane.<\\/em><\\/p>\\r\\n<p><strong><em><em><br><\\/em><\\/em><\\/strong><\\/p>\"}}},\"11\":[\"362\"],\"12\":\"<p>Congratulations on your engagement, and thanks for your interest in becoming married at The Church of the Transfiguration. Our church is a beautiful place with a century-old reputation for marrying couples from all over the world. At one time, Transfiguration solemnized more marriages than any other church! We welcome you to join our \\\"little family\\\", and we hope to become a part of yours.<\\/p>\",\"27\":\"Jesse Anders \\/On Point Images \"}}', '2017-09-14 21:32:47', '2017-09-14 21:32:47', 'd54cf78e-bf1d-4eeb-a497-40ba9757c6f9'),
