is out further, tomorrow, Mary Jane. We can also include downloads to the newsletters, as it is on the existing wedding page.<\\/em><\\/p>\"}}},\"11\":[\"362\"],\"12\":\"<p>Congratulations on your engagement, and thanks for your interest in becoming married at The Church of the Transfiguration. Our church is a beautiful place with a century-old reputation for marrying couples from all over the world. At one time, Transfiguration solemnized more marriages than any other church! We welcome you to join our \\\"little family\\\", and we hope to become a part of yours.<\\/p>\",\"27\":\"Jesse Anders \\/On Point Images \"}}', '2017-09-14 21:36:03', '2017-09-14 21:36:03', '845c602a-9647-4739-b3ce-da7531b48fb9'),
 ('172', '363', '10', '1', 'en_us', '6', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Weddings\",\"slug\":\"weddings\",\"postDate\":1505423640,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"364\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>Weddings at Transfiguration<\\/h2>\\r\\n<p>How Transfiguration became famous as a place to exchange vows remains something of a mystery, but it is generally attributed to the overall openness of the church to people from different Christian denominations, personal situations and backgrounds. Every Saturday in&nbsp;<a href=\\\"https:\\/\\/www.nytimes.com\\/interactive\\/projects\\/cp\\/weddings\\/165-years-of-wedding-announcements\\/world-war-two-weddings\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">the 1930s and 40s<\\/a>&mdash;and often on weekdays&mdash;couples would gather in the garden, awaiting their turn to be married in the Holy Family Chapel. The Rector in that era would marry as many as <strong>seven couples a day<\\/strong>.<br><\\/p>\\r\\n<p>We hear from those couples to this day as part of our&nbsp;<em>Little Family<\\/em>&nbsp;community.&nbsp;We send out several newsletters to them each year and a card goes to all those married here on their anniversaries.<\\/p>\\r\\n<h3>The Space<\\/h3>\\r\\n<p>Tucked behind a lovely English garden with a fountain, Transfiguration is a neo-Gothic church rich with architectural detail. There are two spaces in which you may choose to be married:<\\/p>\\r\\n<p><strong>The Holy Family Chapel<\\/strong> is a quaint room panelled with dark wood that seats up to 50 people&mdash;is appropriate for smaller weddings. The altar piece is a painted depiction of the betrothal of Mary and Joseph. It is in the Holy Family Chapel that thousands of couples in the post-war years became married, making the Little Church famous for weddings.<\\/p>\\r\\n<p><em>I would like to include some images here, so can fill this out further, tomorrow, Mary Jane. We can also include downloads to the newsletters, as it is on the existing wedding page.<\\/em><\\/p>\"}}},\"11\":[\"362\"],\"12\":\"<p>Congratulations on your engagement, and thanks for your interest in becoming married at The Church of the Transfiguration. Our church is a beautiful place with a century-old reputation for marrying couples from all over the world. At one time, Transfiguration solemnized more marriages than any other church! We welcome you to join our \\\"little family\\\", and we hope to become a part of yours.<\\/p>\",\"27\":\"Jesse Anders \\/On Point Images \"}}', '2017-09-14 21:36:12', '2017-09-14 21:36:12', '2a516e8d-a2a1-40d1-bde7-43649f8286f1'),
 ('173', '363', '10', '1', 'en_us', '7', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Weddings\",\"slug\":\"weddings\",\"postDate\":1505423640,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"364\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>Weddings at Transfiguration<\\/h2>\\r\\n<p>How Transfiguration became famous as a place to exchange vows remains something of a mystery, but it is generally attributed to the overall openness of the church to people from different Christian denominations, personal situations and backgrounds. Every Saturday in&nbsp;<a href=\\\"https:\\/\\/www.nytimes.com\\/interactive\\/projects\\/cp\\/weddings\\/165-years-of-wedding-announcements\\/world-war-two-weddings\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">the 1930s and 40s<\\/a>&mdash;and often on weekdays&mdash;couples would gather in the garden, awaiting their turn to be married in the Holy Family Chapel. The Rector in that era would marry as many as seven couples a day.<br><\\/p>\\r\\n<p>We hear from those couples to this day as part of our&nbsp;<em>Little Family<\\/em>&nbsp;community.&nbsp;We send out several newsletters to them each year and a card goes to all those married here on their anniversaries.<\\/p>\\r\\n<h3>The Space<\\/h3>\\r\\n<p>Tucked behind a lovely English garden with a fountain, Transfiguration is a neo-Gothic church rich with architectural detail. There are two spaces in which you may choose to be married:<\\/p>\\r\\n<p><strong>The Holy Family Chapel<\\/strong> is a quaint room panelled with dark wood that seats up to 50 people&mdash;is appropriate for smaller weddings. The altar piece is a painted depiction of the betrothal of Mary and Joseph. It is in the Holy Family Chapel that thousands of couples in the post-war years became married, making the Little Church famous for weddings.<\\/p>\\r\\n<p><em>I would like to include some images here, so can fill this out further, tomorrow, Mary Jane. We can also include downloads to the newsletters, as it is on the existing wedding page.<\\/em><\\/p>\"}}},\"11\":[\"362\"],\"12\":\"<p>Congratulations on your engagement, and thanks for your interest in becoming married at The Church of the Transfiguration. Our church is a beautiful place with a century-old reputation for marrying couples from all over the world. At one time, Transfiguration solemnized more marriages than any other church! We welcome you to join our \\\"little family\\\", and we hope to become a part of yours.<\\/p>\",\"27\":\"Jesse Anders \\/On Point Images \"}}', '2017-09-14 21:40:46', '2017-09-14 21:40:46', '302685b4-168f-469f-8844-6a8496c8e3c8'),
 ('174', '359', '10', '1', 'en_us', '4', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Bible Study\",\"slug\":\"bible-study\",\"postDate\":1505417760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"360\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Book of Revelations<\\/h2>\\r\\n<p>The Thursday night study will resume on September 21st. Our current series focuses on the book of Revelation. If interested, please purchase this&nbsp;<a href=\\\"https:\\/\\/www.amazon.com\\/Book-Revelation-COLLEGEVILLE-COMMENTARY-TESTAMENT\\/dp\\/0814628850\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\"><u>commentary<\\/u><\\/a>&nbsp;and stay tuned for more updates on the new series.<\\/p>\"}}},\"11\":[\"358\"],\"12\":\"<p>Aenean ac velit phasellus vivamus condimentum habitant vestibulum nibh parturient tincidunt mi malesuada cursus nunc risus parturient a condimentum augue gravida metus. Ut at a a turpis facilisi parturient ac non quisque a parturient habitasse cubilia adipiscing imperdiet.<\\/p>\",\"27\":\"\"}}', '2017-09-14 21:44:04', '2017-09-14 21:44:04', 'b790718b-8cb7-4267-af9f-572f9ae6fd37'),
 ('175', '359', '10', '1', 'en_us', '5', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Bible Study\",\"slug\":\"bible-study\",\"postDate\":1505417760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"360\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Book of Revelations<\\/h2>\\r\\n<p>The Thursday night study which resumed on September 21st, continues throughout October. The evening begins with a mass in the chapel at 6:30 PM. Following the mass, the study will begin at 7:00 in the common room. This series is focused on the Book of Revelation.&nbsp;<b>Newcomers Welcome<\\/b>.<\\/p>\"}}},\"11\":[\"358\"],\"12\":\"\",\"27\":\"\"}}', '2017-09-16 15:47:11', '2017-09-16 15:47:11', 'be5a5b14-cb4d-4e94-a26d-bdf257cd7508'),
 ('176', '359', '10', '1', 'en_us', '6', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Bible Study\",\"slug\":\"bible-study\",\"postDate\":1505417760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"360\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Book of Revelation<\\/h2>\\r\\n<p>The Thursday night study which resumed on September 21st, continues throughout October. The evening begins with a mass in the chapel at 6:30 PM. Following the mass, the study will begin at 7:00 in the common room. This series is focused on the Book of Revelation.&nbsp;<strong>Newcomers Welcome<\\/strong>.<\\/p>\"}}},\"11\":[\"358\"],\"12\":\"<p>The Thursday night study which resumed on September 21st, continues throughout October. The evening begins with a mass in the chapel at 6:30 pm. Following the mass, the study will begin at 7:00 pm in the common room.&nbsp;<b>Newcomers Welcome<\\/b>.<\\/p>\",\"27\":\"\"}}', '2017-09-16 15:55:03', '2017-09-16 15:55:03', '4d4c30d7-15e8-4388-9c80-ead8db892b9f'),
 ('177', '359', '10', '1', 'en_us', '7', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Bible Study\",\"slug\":\"bible-study\",\"postDate\":1505417760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"360\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Book of Revelation<\\/h2>\\r\\n<p>The Thursday night study which resumed on September 21st, continues throughout October. The evening begins with a mass in the chapel at 6:30 PM. Following the mass, the study will begin at 7:00 in the common room. This series is focused on the Book of Revelation.&nbsp;<strong>Newcomers Welcome<\\/strong>.<\\/p>\"}}},\"11\":[\"358\"],\"12\":\"<p>The Thursday night study, which resumed on September 21st, continues throughout October. The evening begins with a mass in the chapel at 6:30 pm. Following the mass, the study will begin at 7:00 pm in the common room.&nbsp;<strong>Newcomers Welcome<\\/strong>.<\\/p>\",\"27\":\"\"}}', '2017-09-16 16:01:10', '2017-09-16 16:01:10', 'c46dd601-48e4-4667-b184-6d6f8fff3f7a'),
 ('178', '359', '10', '1', 'en_us', '8', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Bible Study\",\"slug\":\"bible-study\",\"postDate\":1505417760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"360\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Book of Revelation<\\/h2>\\r\\n<p>Our current series is focused on&nbsp;the Book of Revelations.&nbsp;The group will be using this commentary:&nbsp;<em>The Book of Revelation: Volume 12<\\/em> (NEW COLLEGEVILLE BIBLE COMMENTARY: NEW TESTAMENT) (Pt. 12). <a href=\\\"https:\\/\\/www.amazon.com\\/Book-Revelation-COLLEGEVILLE-COMMENTARY-TESTAMENT\\/dp\\/0814628850\\\" target=\\\"_blank\\\">Purchase on Amazon<\\/a>.<\\/p>\\r\\n<p>For any questions about this series, please contact Fr. Cheng at AssociateRector@littlechurch.org.<\\/p>\"}}},\"11\":[\"358\"],\"12\":\"<p>The Thursday night study, which resumed on September 21st, continues throughout October. The evening begins with a mass in the chapel at 6:30 pm. Following the mass, the study will begin at 7:00 pm in the common room.&nbsp;<strong>Newcomers Welcome<\\/strong>.<\\/p>\",\"27\":\"\"}}', '2017-09-16 16:06:11', '2017-09-16 16:06:11', 'dd8f7c0f-a57a-4236-a762-3d8af51c4e5f'),
 ('179', '359', '10', '1', 'en_us', '9', '', '{\"typeId\":\"10\",\"authorId\":\"1\",\"title\":\"Bible Study\",\"slug\":\"bible-study\",\"postDate\":1505417760,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"360\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Book of Revelation<\\/h2>\\r\\n<p>Our current series is focused on&nbsp;the Book of Revelations.&nbsp;The group will be using this commentary:&nbsp;<em>The Book of Revelation: Volume 12<\\/em> (NEW COLLEGEVILLE BIBLE COMMENTARY: NEW TESTAMENT) (Pt. 12). <a href=\\\"https:\\/\\/www.amazon.com\\/Book-Revelation-COLLEGEVILLE-COMMENTARY-TESTAMENT\\/dp\\/0814628850\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Purchase on Amazon<\\/a>.<\\/p>\\r\\n<p>For any questions about this series, please contact Fr. Cheng at AssociateRector@littlechurch.org.<\\/p>\"}}},\"11\":[\"358\"],\"12\":\"<p>The Thursday night study, which resumed on September 21st, continues throughout October. The evening begins with a mass in the chapel at 6:30 pm. Following the mass, the study will begin at 7:00 pm in the common room.&nbsp;<strong>Newcomers Welcome<\\/strong>.<\\/p>\",\"27\":\"\"}}', '2017-09-16 16:17:13', '2017-09-16 16:17:13', 'fe1f844c-4537-4586-b67a-267d4f3de2e5'),
 ('180', '375', '10', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Adult Education\",\"slug\":\"adult-education\",\"postDate\":1505579103,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"13\":{\"new1\":{\"type\":\"generalSection\",\"enabled\":\"1\",\"fields\":{\"text\":\"<h2>The Bible and Sexuality<\\/h2><p>Adult Christian education classes at Transfiguration will resume in October with a five-week series on the Bible and sexuality. Come explore what the Hebrew Bible, Apocrypha, and New Testament have to say to us today about topics such as marriage, sexual ethics, and LGBT issues.<\\/p>\"}}},\"11\":[\"374\"],\"12\":\"<p>Our Adult Education forums cover a wide variety of spiritual topics both within the Church and elsewhere. The series hosts a number of guest speakers and facilitators and promises an hour of entertaining and informational learning and discussion.<br><\\/p>\",\"27\":\"\"}}', '2017-09-16 16:25:03', '2017-09-16 16:25:03', '5f22ecd1-527b-4f5a-8f3a-742bccc14ed1');
