INSERT INTO `craft_matrixcontent_blogarticlematrix` (`id`, `elementId`, `locale`, `field_paragraph_text`, `field_figure_altAttribute`, `field_figure_caption`, `field_figure_enlarge`, `field_figure_orientation`, `field_footnote_text`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '107', 'en_us', '<p>I was paging my way through <em>Holy Men, Holy Women</em> on a fact-checking mission when I came across the entry for December 16<sup>th</sup>.</p>\n<p>\n</p>\n<p>I was stunned to see that this day had been set apart to honor two architects and an artist whose work was represented here at Transfiguration:  Ralph Adams Cram, designer of St. Thomas Church NYC and the nave of the Cathedral of St. John the Divine, Richard Upjohn, the designer of Trinity Church on Wall Street in lower Manhattan, and John Lafarge, painter of murals and designer of many notable stained glass windows.</p>\n<p>\n</p>\n<p><em>Holy Men, Holy Women</em> encourages us to offer thanks for “the vision of Ralph Adams Cram, John LaFarge and Richard Upjohn, whose harmonious revival of the Gothic enriched our churches with a sacramental understanding of reality in the face of secular materialism…” *</p>', NULL, NULL, '0', NULL, NULL, '2017-08-30 13:55:36', '2017-08-31 17:46:16', 'ef686f01-e96c-4d61-abf2-889167ff0e4e'),
 ('2', '108', 'en_us', '<p><em>Holy Men, Holy Women</em> encourages us to offer thanks for “the vision of Ralph Adams Cram, John LaFarge and Richard Upjohn, whose harmonious revival of the Gothic enriched our churches with a sacramental understanding of reality in the face of secular materialism…” *<br /></p>\n<p>Ralph Adams Cram was the designer of our beautiful polychromed wood Madonna Shrine, located in the Transept. It was donated by Mr. F. E. Saxham Drury in memory of Elbridge T. Gerry and Mabel Gerry Drury.<br /></p>\n<p>Turn to your right, and there is John LaFarge’s magnificent window depicting Edwin Booth, the leading Shakespearean actor of his time, holding a mask and dressed in Greco-Roman costume.  (Edwin Booth was the brother of the notorious John Wilkes Booth, President Lincoln’s assassin.) The window was given in his memory in 1898 by members of the Players Club, which he founded.</p>', NULL, NULL, '0', NULL, NULL, '2017-08-30 14:03:42', '2017-08-31 17:46:16', 'a6c9e6ea-3785-4259-b4b1-4116dee5c543'),
 ('3', '111', 'en_us', NULL, 'John LaFarge’s magnificent window depicting Edwin Booth', '<p>John LaFarge’s magnificent window depicting Edwin Booth</p>', '1', 'vertical', NULL, '2017-08-30 14:11:22', '2017-08-31 17:46:16', '388c54de-7872-4860-9c23-4a26626f9fa0'),
 ('4', '116', 'en_us', '<p>Sem natoque nulla ligula ullamcorper facilisi semper conubia inceptos a risus aptent egestas dictumst vulputate at ultrices fermentum pretium hendrerit ad a. Suspendisse tristique consequat torquent ipsum hac cum a at ac at phasellus id fringilla dis risus auctor himenaeos parturient ac vestibulum dis faucibus litora. Ultrices et facilisi neque suscipit ad torquent convallis cras nisl condimentum a suspendisse felis vestibulum ridiculus suscipit nunc dapibus ac velit a. </p>\n<h2>Blessing of the Animals</h2><p>Eleifend ut vivamus parturient hendrerit est parturient a nec elit a ante nec adipiscing condimentum velit montes metus eu sagittis enim. Turpis a diam ultricies arcu curabitur dignissim eleifend non aliquam interdum ad nulla tincidunt aenean aptent fringilla consectetur primis neque. Id scelerisque laoreet ad scelerisque ligula ut vestibulum praesent cras a habitant consectetur purus parturient. Eu laoreet nam in hac inceptos in hendrerit lobortis sociosqu cum elit aliquam condimentum ad a. </p>\n<p>Vestibulum mi parturient auctor lectus suscipit curae litora lectus condimentum cubilia dui porttitor blandit ut. Faucibus penatibus a eros etiam pulvinar ultricies in a egestas vestibulum cum massa quisque interdum. Ullamcorper vestibulum parturient et mattis mi parturient sagittis praesent morbi netus condimentum fermentum ullamcorper ligula ante molestie hac phasellus facilisi class mattis blandit urna ridiculus ante magnis sociosqu a. Aliquet turpis ligula eros ad parturient parturient malesuada penatibus aliquet mi adipiscing ad pulvinar cubilia scelerisque laoreet penatibus vivamus a a scelerisque. Parturient ad massa cum nisi senectus massa taciti vestibulum accumsan magna in parturient nibh odio. A mi velit erat ullamcorper rutrum lacus vestibulum donec sit duis maecenas nam hendrerit gravida sed turpis enim scelerisque senectus laoreet quam lectus id adipiscing. </p>\n<p>Adipiscing parturient ad condimentum at a ac lacus montes rhoncus arcu vel condimentum magnis venenatis praesent sem scelerisque dis eleifend urna gravida a ullamcorper a nisi ullamcorper sed lacus. Natoque vel nullam curabitur eu sem eu purus suspendisse et accumsan scelerisque adipiscing sit adipiscing suspendisse consectetur lacinia sociis commodo vestibulum natoque egestas. Ut faucibus fringilla habitasse elementum odio euismod adipiscing varius massa in parturient a gravida nostra sit. <br /></p>\n<p>Facilisi parturient tempus parturient interdum leo dis ullamcorper scelerisque odio vulputate feugiat suspendisse a eu varius hac diam neque phasellus tempor. Aenean maecenas a neque sed a a tortor vestibulum ad eu aptent consectetur nullam tortor. Vestibulum facilisis pharetra imperdiet nullam rutrum sem suspendisse a litora a id eu lacinia elit mus morbi a in in sociosqu ad in id torquent sodales.</p>', NULL, NULL, '0', NULL, NULL, '2017-08-30 15:21:41', '2017-08-31 14:04:55', '4810b30c-013b-4ebc-8657-70f5da206132'),
 ('5', '122', 'en_us', NULL, 'Richard Upjohn’s beautiful and intricate brass filigree pulpit', '<p>Richard Upjohn’s beautiful and intricate brass filigree pulpit</p>', '1', 'horizontal', NULL, '2017-08-30 23:13:51', '2017-08-31 17:46:16', '32537d6d-5330-4097-b52d-e842bdd7dd27'),
 ('6', '123', 'en_us', '<p>Ralph Adams Cram was the designer of our beautiful polychromed wood Madonna Shrine, located in the Transept.  It was donated by Mr. F. E. Saxham Drury in memory of Elbridge T. Gerry and Mabel Gerry Drury.</p>\n<p>And a few steps away, near the chancel on the northeast side of the nave, stands Richard Upjohn’s beautiful and intricate brass filigree pulpit.</p>', NULL, NULL, '0', NULL, NULL, '2017-08-30 23:13:51', '2017-08-31 17:46:16', '2427c040-21be-412c-9813-366c60df2a60'),
 ('7', '126', 'en_us', '<p>How fortunate we are to have works by all three of these masters under the roof of the “Little Church”.  I will give thanks when December 16<sup>th</sup> rolls around.</p>', NULL, NULL, '0', NULL, NULL, '2017-08-30 23:20:46', '2017-08-31 17:46:16', 'ac98a5c2-7bca-4ca5-9e8b-29c9d67d081c'),
 ('9', '218', 'en_us', NULL, NULL, NULL, '0', NULL, '<p><em>Holy Women, Holy Men: Celebrating the Saints</em> by Church Publishing Incorporated</p>', '2017-08-31 11:49:46', '2017-08-31 17:46:16', 'dd4379b0-0e26-4f52-b243-74e7ca4f240c'),
 ('10', '224', 'en_us', '<p>Besides being an oasis of rest and comfort for one and all, the garden provides a small but significant ecological benefit for everyone. The wide expanse of plants, shrubs and trees offsets carbon emissions, and the peace and quiet of the garden offer relief from the city’s noise pollution. </p>\n<p>Birds stop by to dip their beaks in the fountain. During the week, it’s a popular lunch spot for people who work in the neighborhood, and on Sundays in warm weather, it’s the site of coffee hour. This past summer, the garden was enhanced with the generous gift of a young tree from a friend at the nearby James Hotel. Please stop by if you’re in the neighborhood. You will always be welcome here.</p>', NULL, NULL, '0', NULL, NULL, '2017-08-31 14:22:23', '2017-08-31 14:24:08', '620562e0-11f6-4f4f-9512-0b3889505ca3');
INSERT INTO `craft_matrixcontent_contentmatrix` (`id`, `elementId`, `locale`, `field_generalSection_text`, `field_figureFull_altAttribute`, `field_figureFull_caption`, `field_figureFull_credit`, `field_bioGroup_bioType`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '71', 'en_us', '<h2>Faith and Works</h2>\n<p>From the time of our founding in the mid 19th century, our motto has remained Fides Opera (Faith and Works). Our faith is expressed in the depth of resplendent worship, offering our very best in praise of God in the person of Jesus Christ. From this worship flows an outward ministry of works to a city and world crying for mindful and responsive hands, feet, and hearts.  </p>\n<p>“In God, that which is ancient never becomes old,” and we embrace this sentiment combining traditional liturgical worship with a radical inclusiveness deeply rooted in our parish’s history and celebrated by a vibrant diocese in which we serve.  Please consider this parish as you look for a spiritual home. All are welcome.</p>\n<p>With loving wishes, </p>\n<p>Fr. John David van Dooren<br />Rector</p>', NULL, NULL, NULL, NULL, '2017-08-28 12:21:29', '2017-09-14 19:49:02', '4efea349-f217-4160-85b7-fb6fad4d8eea'),
 ('6', '88', 'en_us', NULL, NULL, NULL, NULL, 'Leadership', '2017-08-28 19:41:48', '2017-09-17 09:23:33', '0e26c93d-dfb4-4626-ab43-0a809e7e7f98'),
 ('8', '236', 'en_us', '<h2>The Civil War</h2>\n<p>The parish had only been established for a few years, when the Civil War broke out. During this time, the church was a stop on the Underground Railroad, sheltering escaped slaves on their journey north. It was a place of refuge for African Americans during the New York Draft Riots of 1863—three days of lawlessness, destruction, bloodshed, and lynchings.</p>\n<h2>The Nickname</h2>\n<p>A few days before Christmas in 1890, Joseph Jefferson, an actor renowned for his portrayal of Rip Van Winkle, approached the rector of the now-defunct Church of the Atonement to request a funeral for his friend and fellow actor, George Holland.  Upon learning that the deceased was an actor, the rector refused to hold a funeral for the man in his church. Joseph Jefferson persisted, and asked if there was a church in the area that would hold services for his friend. The rector said, “I believe there is a little church around the corner where it might be done.” Jefferson replied, </p>\n<blockquote>“Then I say to you, sir, God bless the little church around the corner.”</blockquote>', NULL, NULL, NULL, NULL, '2017-08-31 20:29:51', '2017-09-04 20:58:26', '95a47034-3045-4f2f-a8c1-23423df1e32d'),
 ('9', '240', 'en_us', '<h2>Coffee, conversation, and community</h2>\n<p>Sunday Coffee Hours also afford parishioners and newcomers opportunities to interact and to build relationships that often result in invitations to break bread or to take advantage of the many cultural events in New York. Fundraisers, like our Spring Music Gala, are also a great way to interact with fellow parishioners and to enjoy the talent and hospitality of our parish.</p>\n<p>Sign up for our <a href=\"http://lc-craft/grace/entries/about/new#\">weekly Friday blasts</a> and check <a href=\"http://lc-craft/grace/entries/about/new#\">our calendar</a> for upcoming events and opportunities to participate in the robust Parish Life of Church of the Transfiguration.</p>', NULL, NULL, NULL, NULL, '2017-08-31 20:36:16', '2017-09-16 23:19:26', 'a5bedbb0-9db6-4341-a650-1b3dead7ad93'),
 ('10', '245', 'en_us', '<p>At the center of our worship is emphasis on both Word and Table. Little Church clergy are considered <a href=\"#\">excellent preachers</a> who connect lectionary readings with Biblical context and current challenges with a smattering of personal stories and humor. Transfiguration acolytes do an extraordinary job in ensuring the Eucharist is celebrated with majesty and dignity, and the authentic expertise of <a href=\"#\">our choirs</a> draws worshippers closer to the love of Jesus Christ through some of the most beloved hymns of the Church. Below is the current worship schedule. Please consider joining us!</p>\n<h2>Worship Schedule</h2>', NULL, NULL, NULL, NULL, '2017-09-01 10:13:16', '2017-09-14 19:22:55', '5a3b9ab1-6b50-436d-9ec0-0bda511fb980'),
 ('11', '269', 'en_us', NULL, '', '', '', NULL, '2017-09-04 20:55:33', '2017-09-04 20:58:26', '5703149d-2cd0-4258-877f-5ccaf187433a'),
 ('12', '270', 'en_us', '<h2>The Theatre</h2>\n<p>To this day, the church maintains close ties with the theater. It has served as the national headquarters of the Episcopal Actors\' Guild since its founding in 1923, by the third rector, Dr. Randolph Ray.</p>\n<p>\n</p>\n<h2>Weddings</h2>\n<p>Our historic buildings and lovely garden have drawn couples from all over the world to be married here. These couples are members of the \"Little Family,\" and many have stayed in touch with us over the years. Continuing its long tradition of inclusiveness, the \"Little Church\" is proud to have celebrated the first same-sex wedding in the Diocese of New York in July 2012 and has performed several more since the formal rite of Blessing of a Lifelong Covenant was adopted by the General Convention.</p>\n<p>\n</p>\n<p>We invite you to stop by for a <a href=\"#\">visit</a>, join us in <a href=\"{entry:244:url}\">worship</a>, or simply contact us for more information.</p>', NULL, NULL, NULL, NULL, '2017-09-04 20:56:38', '2017-09-04 20:58:26', 'efba149f-13c7-4754-9131-9173a196425e'),
 ('13', '272', 'en_us', '<h2>Ecclesia Ministries</h2>\n<p><strong><a href=\"#\">Ecclesia Ministries</a></strong> takes religious services to the homeless in Madison Square Park. It is a cooperative program supported by various churches and clergy in the NoMad (North of Madison Square Park) area. Transfiguration is one of those congregations; it is also the alternate location when inclement weather makes an outdoor service impractical. Last Christmas, our parishioners donated an abundance of warm gloves, scarves, gloves, hats, long underwear, and other items to people served by Ecclesia Ministries.</p>\n<h2>The Episcopal Actors Guild</h2>\n<p><strong><a href=\"#\">The Episcopal Actors Guild</a> </strong>was founded in 1923 by our third rector, the Rev. Dr. Randolph Ray to bridge the worlds of church and theater. Today, the Guild is a philanthropic organization that raises money and dispenses emergency funds to members of the acting profession facing severe financial hardship. It also has entertainment programs, educational, career development and social events for its members.</p>\n<p>Each November, the Guild holds a memorial service in the church dedicated to members of the profession who died in the previous year. In December, they present a Service of Lessons and Carols with outstanding music, often performed by Broadway veterans. Both events are open to the public.</p>\n<h3>Actor’s Pantry Food Bank</h3>\n<p>Our parishioners support the Episcopal Actors Guild’s Actors Pantry (hyperlink) program. Each Sunday, we collect non-perishable food. The Guild then fills bags with the donated items and gives them to artists in need who have applied to the Guild for help. No one leaves empty-handed.</p>', NULL, NULL, NULL, NULL, '2017-09-05 15:02:17', '2017-09-16 16:19:52', 'd269c35a-7d61-4f78-b51f-d35ccc4c178a'),
 ('15', '288', 'en_us', NULL, NULL, NULL, NULL, NULL, '2017-09-12 09:46:39', '2017-09-12 19:11:02', '0b6ed260-9933-4606-a4f8-cef261f784bd'),
 ('16', '323', 'en_us', NULL, NULL, NULL, NULL, 'Staff', '2017-09-13 08:53:56', '2017-09-17 09:23:33', '9525d455-7952-4d17-a26c-4a2b21d7a021'),
 ('17', '330', 'en_us', '<h2>About Claudia</h2>\n<p>Dr. Dumschat received her doctorate from the Manhattan School of Music and has performed organ concerts throughout the United States and Europe. She is the recipient of many awards and has been recorded on CD and is heard frequently on the radio. Many of her performances may also be viewed on <a href=\"https://www.youtube.com/channel/UCtDTSov-BBN5dNcG7OlKn5A\" target=\"_blank\" rel=\"noreferrer noopener\">her YouTube channel</a>.</p>\n<p>She is currently on the Board of the New York Chapter of the American Guild of Organists, a Council member of the Episcopal Actors Guild, and Chair of the Music Committee of the Greenwich Pen Women.</p>', NULL, NULL, NULL, NULL, '2017-09-13 09:42:53', '2017-09-13 10:47:26', '165b7b17-941d-4526-b5e0-2b3d7627f62d'),
 ('18', '336', 'en_us', NULL, 'The Arnold Schwartz Memorial Organ', '', 'Carl Avidano', NULL, '2017-09-13 10:42:19', '2017-09-13 10:47:26', '64cd04ed-22f3-4c39-a3d2-32bb74ff5313'),
 ('19', '337', 'en_us', '<h2>The Arnold Schwartz Memorial Organ</h2>\n<p>Our beautiful organ is named for the major donor, is Opus 92 of the C. B. Fiske Company. Church of the Transfiguration has an extensive music program including a Men and Boys Choir and a Girls Choir. Our Music Director, Dr. Claudia Dumschat auditions children from all over the city. Those accepted for the choirs receive an excellent musical education and ample opportunities to perform.</p>', NULL, NULL, NULL, NULL, '2017-09-13 10:45:04', '2017-09-13 10:47:26', 'e6232f71-97d0-4a31-9a10-ffa3daa2da9a'),
 ('20', '340', 'en_us', '<h2>A Litte Midday Music</h2>\n<p>Lunchtime concerts at Little Church <strong>Tuesdays at 12:30 pm</strong>. $5 suggested donation. </p>\n<h3>2017 Fall Schedule </h3>\n<p>Schedule here</p>\n<h3>2018 Spring Schedule </h3>\n<p>Schedule here</p><p><br /></p>', NULL, NULL, NULL, NULL, '2017-09-13 11:04:37', '2017-09-13 11:50:57', '2b967c7c-a3e5-4b3b-bbe9-4e691d714397'),
 ('21', '356', 'en_us', '<h2>Vestibulum Consequat Ullamcorper</h2><p>Torquent magnis sagittis elit a per duis convallis a vitae phasellus vestibulum adipiscing habitant a id elit. Torquent parturient parturient facilisis dis mi ultrices facilisis accumsan facilisis phasellus lobortis lacus sodales a a erat. Leo hendrerit nulla vestibulum scelerisque ultricies vestibulum inceptos sapien ut aenean consectetur ullamcorper a metus a tristique vulputate sagittis. </p><p>Ad nunc et adipiscing quisque conubia condimentum a consectetur eu ultrices ullamcorper parturient vestibulum a volutpat faucibus elit enim non platea suspendisse a posuere adipiscing ullamcorper adipiscing ac vel. Taciti aliquet metus natoque libero nunc tempor a vestibulum accumsan cubilia nullam duis quam in ad at a consectetur non laoreet scelerisque ac ridiculus cum sodales quisque a mi.</p>', NULL, NULL, NULL, NULL, '2017-09-14 19:23:56', '2017-09-14 19:24:45', '3651d139-0d1a-4482-accb-814d36ecd0cd'),
 ('22', '360', 'en_us', '<h2>The Book of Revelation</h2>\n<p>Our current series is focused on the Book of Revelations. The group will be using this commentary: <em>The Book of Revelation: Volume 12</em> (NEW COLLEGEVILLE BIBLE COMMENTARY: NEW TESTAMENT) (Pt. 12). <a href=\"https://www.amazon.com/Book-Revelation-COLLEGEVILLE-COMMENTARY-TESTAMENT/dp/0814628850\" target=\"_blank\" rel=\"noreferrer noopener\">Purchase on Amazon</a>.</p>\n<p>For any questions about this series, please contact Fr. Cheng at AssociateRector@littlechurch.org.</p>', NULL, NULL, NULL, NULL, '2017-09-14 19:36:40', '2017-09-16 16:17:13', '4d7c0143-035b-4a37-85c0-2854e9bb998f'),
 ('23', '364', 'en_us', '<h2>Weddings at Transfiguration</h2>\n<p>How Transfiguration became famous as a place to exchange vows remains something of a mystery, but it is generally attributed to the overall openness of the church to people from different Christian denominations, personal situations and backgrounds. Every Saturday in <a href=\"https://www.nytimes.com/interactive/projects/cp/weddings/165-years-of-wedding-announcements/world-war-two-weddings\" target=\"_blank\" rel=\"noreferrer noopener\">the 1930s and 40s</a>—and often on weekdays—couples would gather in the garden, awaiting their turn to be married in the Holy Family Chapel. The Rector in that era would marry as many as seven couples a day.<br /></p>\n<p>We hear from those couples to this day as part of our <em>Little Family</em> community. We send out several newsletters to them each year and a card goes to all those married here on their anniversaries.</p>\n<h3>The Space</h3>\n<p>Tucked behind a lovely English garden with a fountain, Transfiguration is a neo-Gothic church rich with architectural detail. There are two spaces in which you may choose to be married:</p>\n<p><strong>The Holy Family Chapel</strong> is a quaint room panelled with dark wood that seats up to 50 people—is appropriate for smaller weddings. The altar piece is a painted depiction of the betrothal of Mary and Joseph. It is in the Holy Family Chapel that thousands of couples in the post-war years became married, making the Little Church famous for weddings.</p>\n<p><em>I would like to include some images here, so can fill this out further, tomorrow, Mary Jane. We can also include downloads to the newsletters, as it is on the existing wedding page.</em></p>', NULL, NULL, NULL, NULL, '2017-09-14 21:32:47', '2017-09-14 21:40:46', '97b76907-dcfa-4001-ad7a-7cf573421990'),
 ('24', '376', 'en_us', '<h2>The Bible and Sexuality</h2><p>Adult Christian education classes at Transfiguration will resume in October with a five-week series on the Bible and sexuality. Come explore what the Hebrew Bible, Apocrypha, and New Testament have to say to us today about topics such as marriage, sexual ethics, and LGBT issues.</p>', NULL, NULL, NULL, NULL, '2017-09-16 16:25:03', '2017-09-16 16:25:03', 'af0193bf-6c2e-4721-887d-a66b26d57a7b');
