 ('69', 'field', '12', 'en_us', ' greetings and welcome to the church of the transfiguration also known affectionately as the little church around the corner our parish combines the beauty and depth of the anglo catholic tradition with the warmth of a dear community of people seeking the presence of christ in the center of the nomad neighborhood in manhattan '),
 ('69', 'field', '13', 'en_us', ' faith and works from the time of our founding in the mid 19th century our motto has remained fides opera faith and works our faith is expressed in the depth of resplendent worship offering our very best in praise of god in the person of jesus christ from this worship flows an outward ministry of works to a city and world crying for mindful and responsive hands feet and hearts in god that which is ancient never becomes old and we embrace this sentiment combining traditional liturgical worship with a radical inclusiveness deeply rooted in our parish s history and celebrated by a vibrant diocese in which we serve please consider this parish as you look for a spiritual home all are welcome with loving wishes fr john david van doorenrector '),
