 ('229', 'field', '24', 'en_us', ' associate rector '),
 ('229', 'field', '1', 'en_us', ' fr patrick cheng has served on the staff of the church of the transfiguration since 2015 first as an associate priest and currently as the associate rector prior to his arrival at the little church fr cheng taught historical and systematic theology at the episcopal divinity school in cambridge massachusetts and served as the pastoral assistant at emmanuel church in the city of boston in addition to his ministry at transfiguration fr cheng works for a national agency of the episcopal church and he serves on the board of trustees of the anglican theological review he holds degrees from yale college harvard law school and union theological seminary in the city of new york for more information about fr cheng please see his website at www patrickcheng net '),
 ('94', 'field', '28', 'en_us', ' i was paging my way through holy men holy women on a fact checking mission when i came across the entry for december 16th i was stunned to see that this day had been set apart to honor two architects and an artist whose work was represented here at transfiguration ralph adams cram designer of st thomas church nyc and the nave of the cathedral of st john the divine richard upjohn the designer of trinity church on wall street in lower manhattan and john lafarge painter of murals and designer of many notable stained glass windows holy men holy women encourages us to offer thanks for the vision of ralph adams cram john lafarge and richard upjohn whose harmonious revival of the gothic enriched our churches with a sacramental understanding of reality in the face of secular materialism john lafarge s magnificent window depicting edwin booth john lafarge s magnificent window depicting edwin booth 1 edwin booth window verticle vertical holy men holy women encourages us to offer thanks for the vision of ralph adams cram john lafarge and richard upjohn whose harmonious revival of the gothic enriched our churches with a sacramental understanding of reality in the face of secular materialism ralph adams cram was the designer of our beautiful polychromed wood madonna shrine located in the transept it was donated by mr f e saxham drury in memory of elbridge t gerry and mabel gerry drury turn to your right and there is john lafarge s magnificent window depicting edwin booth the leading shakespearean actor of his time holding a mask and dressed in greco roman costume edwin booth was the brother of the notorious john wilkes booth president lincoln s assassin the window was given in his memory in 1898 by members of the players club which he founded ralph adams cram was the designer of our beautiful polychromed wood madonna shrine located in the transept it was donated by mr f e saxham drury in memory of elbridge t gerry and mabel gerry drury and a few steps away near the chancel on the northeast side of the nave stands richard upjohn s beautiful and intricate brass filigree pulpit richard upjohn s beautiful and intricate brass filigree pulpit richard upjohn s beautiful and intricate brass filigree pulpit 1 richard upjohn brass filigree pulpit horizontal how fortunate we are to have works by all three of these masters under the roof of the little church i will give thanks when december 16th rolls around holy women holy men celebrating the saints by church publishing incorporated '),
