 ('78', 'field', '24', 'en_us', ' rector '),
 ('78', 'field', '1', 'en_us', ' fr john david van dooren is a native of north carolina and was graduated from the university of north carolina 1982 and the virginia theological seminary 1987 his first field assignment was to an anglo catholic parish one of the only few in the the area there fr van dooren was introduced to a spirituality that would define his eventual priesthood and lead him to a lifelong commitment to urban ministry after beginning his ordained life as chaplain and track and field coach at st stephen s episcopal school in alexandria va a happy period of life other than wrecking two school busses fr van dooren served as curate of all souls episcopal church in washington dc he then served as an assistant priest at st martin s in the field severna park md before being called back to all souls as their sixth rector after 14 years as rector fr van dooren accepted the call to the church of the atonement in chicago where he served as rector for eleven and half years fr van dooren was elected the eighth rector of transfiguration in early 2017 he has shared the past 30 years of life with gary norcross '),
