 ('234', 'field', '3', 'en_us', ''),
 ('234', 'field', '12', 'en_us', ' church of the transfiguration parish was founded in 1848 the building itself dates from 1850 it was made a national landmark in 1973 the founder the rev dr george hendric houghton wanted to build a church that would serve the needs of the poor and marginalized and would welcome all regardless of race class or background '),
 ('234', 'field', '13', 'en_us', ' the civil war the parish had only been established for a few years when the civil war broke out during this time the church was a stop on the underground railroad sheltering escaped slaves on their journey north it was a place of refuge for african americans during the new york draft riots of 1863 three days of lawlessness destruction bloodshed and lynchings the nickname a few days before christmas in 1890 joseph jefferson an actor renowned for his portrayal of rip van winkle approached the rector of the now defunct church of the atonement to request a funeral for his friend and fellow actor george holland upon learning that the deceased was an actor the rector refused to hold a funeral for the man in his church joseph jefferson persisted and asked if there was a church in the area that would hold services for his friend the rector said i believe there is a little church around the corner where it might be done jefferson replied then i say to you sir god bless the little church around the corner figure window the theatre to this day the church maintains close ties with the theater it has served as the national headquarters of the episcopal actors guild since its founding in 1923 by the third rector dr randolph ray weddings our historic buildings and lovely garden have drawn couples from all over the world to be married here these couples are members of the little family and many have stayed in touch with us over the years continuing its long tradition of inclusiveness the little church is proud to have celebrated the first same sex wedding in the diocese of new york in july 2012 and has performed several more since the formal rite of blessing of a lifelong covenant was adopted by the general convention we invite you to stop by for a visit join us in worship or simply contact us for more information '),
