 ('267', 'field', '42', 'en_us', ' the holy family chapel is open monday through friday every day it receives a steady stream of visitors who come in for a quiet moment to light a candle or to attend the daily mass or prayer services its most memorable feature is the brides altar which was installed in 1926 the painting above the altar is the betrothal of the blessed virgin and st joseph tens of thousands of marriages have taken place before this altar '),
