 ('268', 'field', '42', 'en_us', ' the westmacott madonna is located in the southwest corner of the chapel this beautiful marble statue of the madonna and child is by sir richard westmacott r a who also did the portico sculptures at buckingham palace celebrating the battles of trafalgar and waterloo '),
