 ('270', 'field', '14', 'en_us', ' the theatre to this day the church maintains close ties with the theater it has served as the national headquarters of the episcopal actors guild since its founding in 1923 by the third rector dr randolph ray weddings our historic buildings and lovely garden have drawn couples from all over the world to be married here these couples are members of the little family and many have stayed in touch with us over the years continuing its long tradition of inclusiveness the little church is proud to have celebrated the first same sex wedding in the diocese of new york in july 2012 and has performed several more since the formal rite of blessing of a lifelong covenant was adopted by the general convention we invite you to stop by for a visit join us in worship or simply contact us for more information '),
 ('270', 'slug', '0', 'en_us', ''),
 ('271', 'field', '11', 'en_us', ''),
 ('271', 'field', '27', 'en_us', ''),
 ('271', 'field', '3', 'en_us', ''),
 ('271', 'field', '12', 'en_us', ' our parish was founded to serve the needs of the poor and marginalized and this tradition continues today through several programs perhaps our most important outreach however is the holy family chapel which is open and welcoming to all who are in search of spiritual refreshment '),
 ('271', 'field', '13', 'en_us', ' ecclesia ministries ecclesia ministries takes religious services to the homeless in madison square park it is a cooperative program supported by various churches and clergy in the nomad north of madison square park area transfiguration is one of those congregations it is also the alternate location when inclement weather makes an outdoor service impractical last christmas our parishioners donated an abundance of warm gloves scarves gloves hats long underwear and other items to people served by ecclesia ministries the episcopal actors guild the episcopal actors guild was founded in 1923 by our third rector the rev dr randolph ray to bridge the worlds of church and theater today the guild is a philanthropic organization that raises money and dispenses emergency funds to members of the acting profession facing severe financial hardship it also has entertainment programs educational career development and social events for its members each november the guild holds a memorial service in the church dedicated to members of the profession who died in the previous year in december they present a service of lessons and carols with outstanding music often performed by broadway veterans both events are open to the public actor s pantry food bank our parishioners support the episcopal actors guild s actors pantry hyperlink program each sunday we collect non perishable food the guild then fills bags with the donated items and gives them to artists in need who have applied to the guild for help no one leaves empty handed '),
 ('271', 'slug', '0', 'en_us', ' outreach '),
