 ('329', 'field', '12', 'en_us', ' dr claudia dumschat brings over forty years of experience to her position as organist and choirmaster at transfiguration where she has served since 1999 she administers and conducts the choir of men and boys girls choir cherub choir and camerata she is also the artistic director and conductor of the church s concert series which has produced over fifty concerts music dramas and operas as well as the midday music and summer concerts series '),
