 ('329', 'field', '13', 'en_us', ' about claudia dr dumschat received her doctorate from the manhattan school of music and has performed organ concerts throughout the united states and europe she is the recipient of many awards and has been recorded on cd and is heard frequently on the radio many of her performances may also be viewed on her youtube channel she is currently on the board of the new york chapter of the american guild of organists a council member of the episcopal actors guild and chair of the music committee of the greenwich pen women the arnold schwartz memorial organ our beautiful organ is named for the major donor is opus 92 of the c b fiske company church of the transfiguration has an extensive music program including a men and boys choir and a girls choir our music director dr claudia dumschat auditions children from all over the city those accepted for the choirs receive an excellent musical education and ample opportunities to perform the arnold schwartz memorial organ carl avidano figure organ '),
