 ('363', 'field', '12', 'en_us', ' congratulations on your engagement and thanks for your interest in becoming married at the church of the transfiguration our church is a beautiful place with a century old reputation for marrying couples from all over the world at one time transfiguration solemnized more marriages than any other church we welcome you to join our little family and we hope to become a part of yours '),
