 ('363', 'field', '13', 'en_us', ' weddings at transfiguration how transfiguration became famous as a place to exchange vows remains something of a mystery but it is generally attributed to the overall openness of the church to people from different christian denominations personal situations and backgrounds every saturday in the 1930s and 40s and often on weekdays couples would gather in the garden awaiting their turn to be married in the holy family chapel the rector in that era would marry as many as seven couples a day we hear from those couples to this day as part of our little family community we send out several newsletters to them each year and a card goes to all those married here on their anniversaries the space tucked behind a lovely english garden with a fountain transfiguration is a neo gothic church rich with architectural detail there are two spaces in which you may choose to be married the holy family chapel is a quaint room panelled with dark wood that seats up to 50 people is appropriate for smaller weddings the altar piece is a painted depiction of the betrothal of mary and joseph it is in the holy family chapel that thousands of couples in the post war years became married making the little church famous for weddings i would like to include some images here so can fill this out further tomorrow mary jane we can also include downloads to the newsletters as it is on the existing wedding page '),
