 ('384', 'field', '50', 'en_us', ' on the first sunday in october 1848 george hendric houghton gathered a band of twenty four followers for a celebration of holy communion in the parlor of the home of the rev dr lawson carter an elderly priest on east 24th street none of those first worshipers could have imagined that they had just attended the first service of the church of the transfiguration later to be celebrated as the little church around the corner the twenty eight year old priest who called this small congregation into being however had a clear vision in mind to establish a parish that would minister to the poor and needy of new york city the first service in the new church was held on sunday march 28th 1850 excerpted from a parish guide to the church of the transfiguration by zulette m catir his motto was fides opera faith and works '),
